    {'quote': "It's not a lie... if you believe it.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Beard'},
    {'quote': 'Order! Order in this court, I will clear this room! I do not know how, or under what circumstances the four of you found each other, but your callous indifference and utter disregard for everything that is good and decent has rocked the very foundation upon which our society is built. I can think of nothing more fitting than for the four of you to spend a year removed from society so that you can contemplate the manner in which you have conducted yourselves. I know I will. This court is adjourned.', 'first_name': 'Judge Arthur', 'last_name': 'Vandelay', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Finale'},
    {'quote': 'Ladies and gentlemen, last year, our City Council by a vote of twelve to two, passed a Good Samaritan Law. Now, essentially, we made it a crime to ignore a fellow human being in trouble. Now this group from New York not only ignored, but, as we will prove, they actually mocked the victim as he was being robbed at gunpoint. I can guarantee you one other thing, ladies and gentlemen: This is not the first time they have behaved in this manner. On the contrary, they have quite a record of mocking and maligning. This is a history of selfishness, self-absorption, immaturity, and greed. And you will see how everyone who has come into contact with these four individuals has been abused, wronged, deceived, and betrayed. This time, they have gone too far. This time, they are going to be held accountable. This time, they are the ones who will pay.', 'first_name': 'District Attorney', 'last_name': 'Hoyt', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Finale'},
    {'quote': "Then he got me an apartment in his building. But they mixed up the mail. And I never got my immigration renewal papers. So they deported me. It's all his fault. Him. And the woman. But they did not care. They're totally indifferent. All they do is mock me, just like they did the fat fellow. All the time. Mocking, mocking, mocking, mocking, mocking. All the time! Now it is Babu's turn to mock. Finally, I will have some justice. Send them away! Send them all away! Lock them up forever! They are not human. Very bad! Very, very, very bad!", 'first_name': 'Babu', 'last_name': 'Bhatt', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Finale'},
    {'quote': "I am shocked and chagrined, mortified and stupefied. This trial is outrageous! It is a waste of the taxpayers' time and money. It is a travesty of justice that these four people have been incarcerated while the real perpetrator is walking around laughing—lying and laughing, laughing and lying. You know what these four people were? They were innocent bystanders. Now, you just think about that term. Innocent. Bystanders. Because that's exactly what they were. We know they were bystanders, nobody's disputing that. So how can a bystander be guilty? No such thing. Have you ever heard of a guilty bystander? No, because you cannot be a bystander and be guilty. Bystanders are by definition, innocent. That is the nature of bystanding. But no, they want to change nature here. They want to create a whole new animal—the guilty bystander. Don't you let them do it. Only you can stop them.", 'first_name': 'Jackie', 'last_name': 'Chiles', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Finale'},
    {'quote': "See, the great thing about robbing a fat guy is it's an easy getaway. You know? They can't really chase ya!", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Finale'},
    {'quote': 'Do you know what day this is? Because I know what day this is, they know what day this is, so I was wondering if you know what day this is!', 'first_name': 'Bob', 'last_name': '', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Puerto Rican Day'},
    {'quote': "All right! But hear me and hear me well—the day will come. Oh yes, mark my words, Seinfeld—your day of reckoning is coming. When an evil wind will blow through your little play world and wipe that smug smile off your face. And I'll be there, in all my glory, watching—watching as it all comes crumbling down.", 'first_name': 'Newman', 'last_name': '', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Finale'},
    {'quote': "Uh, yes, most likely, yes. I'm, uh, H. E. Pennypacker. I'm a wealthy industrialist and philanthropist and, uh, a bicyclist. And, um, yes, I'm looking for a place where I can settle down with my, uh, peculiar habits, and, uh, the women that I frequent with.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Puerto Rican Day'},
    {'quote': "Jerry. It's L.A. Nobody leaves. She's a seductress, she's a siren, she's a virgin, she's a whore.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Finale'},
    {'quote': "Hey, I'm on first and first. How can the same street intersect with itself? I must be at the nexus of the universe.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Maid'},
    {'quote': "What is nice? Trying to fill the void in your life with flour and sugar and egg and vanilla? I mean, we are all unhappy. Do we have to be fat, too? Not you, Becky; I know you have a slow metabolism. I don't want one more piece of cake in my office!", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Frogger'},
    {'quote': "Look, I work for the phone company. I've had a lot of experience with semantics, so don't try to lure me into some maze of circular logic.", 'first_name': 'Phone Guy', 'last_name': '#1', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Maid'},
    {'quote': "I had to take a sick day. I'm so sick of these people.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Frogger'},
    {'quote': "I'm afraid the problem with Zach is more serious. He's back on the horse, Elaine. Smack. White palace. The Chinaman's nightcap.", 'first_name': 'J.', 'last_name': 'Peterman', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Bookstore'},
    {'quote': 'You mean my crime of passion? If anyone betrays me, I never forget!', 'first_name': 'Uncle', 'last_name': 'Leo', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Bookstore'},
    {'quote': "David, I'm going to hell! The worst place in the world! With devils and those caves and the ragged clothing! And the heat! My god, the heat! I mean, what do you think about all that?", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Burning'},
    {'quote': 'The haunting memories of lost love. May I? Lights? Our eyes met across the crowded hat store. I, a customer, and she a coquettish haberdasher.  Oh, I pursued and she withdrew, then she pursued and I withdrew, and so we danced. I burned for her, much like the burning during urination that I would experience soon afterwards.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Burning'},
    {'quote': "I like Christian rock. It's very positive. It's not like those real musicians who think they're so cool and hip.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Burning'},
    {'quote': "I'm calling up the Rosses and inviting them up to my nonexistent place in the Hamptons. Then we'll see who blinks first.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Wizard'},
    {'quote': 'He wants to install Kramer in a puppet regime and then wield power from behind the scenes. Preferably from the sauna in the clubhouse.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Wizard'},
    {'quote': "I refuse to give up on this relationship. It's like launching missiles from a submarine. Both of us have to turn our keys.", 'first_name': 'Maura', 'last_name': '', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Strong Box'},
    {'quote': "Hey! You’re Jerry's friend. You're goofy. Mind if I sit? My show is going really well. Have you seen it yet? you should. Everybody else have and you know what? I got recognized the other day. How weird is that? I know. At first I liked the attention, but it's like, whoa! Take three steps back. Get a life, OK. But then there wouldn't be a Sally Weaver without the fans, know what I mean? But who am I? anyway. I mean, there's Sally Weaver the woman, Sally Weaver the artist, Sally Weaver the person...", 'first_name': 'Sally', 'last_name': 'Weaver', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Cartoon'},
    {'quote': "Hey, Silvio, look at Jerry here, prancing around in his coat with his purse. Yup, he's a dandy. He's a real fancy boy.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Reverse Peephole'},
    {'quote': 'What do I need to talk for…ha!...For to blab to the neighbors about George has a new fem-Jerry friend or to tell everybody at the coffee shop how George is all mixed up in a perverse sexual amalgam of some girl and his best friend?', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Cartoon'},
    {'quote': "She does stink and she should quit. But I don't want it to be because of me. It should be the traditional route; years of rejections and failures ’til she's spit out the bottom of the porn industry.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Cartoon'},
    {'quote': 'I think I could be a philanthropist. a kick-ass philanthropist! I would have all this money and people would love me. Then they would come to me and beg! And if I felt like it, I would help them out. And then they would owe me big time!', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Strike'},
    {'quote': 'Many Christmases ago, I went to buy a doll for my son. I reach for the last one they had—but so did another man. As I rained blows upon him, I realized there had to be another way!', 'first_name': 'Frank', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Strike'},
    {'quote': "I'm homeless! I'm gonna be out on a street corner, dancing for nickels. I'll be with the hobos in the train yard, eating out of a bucket.", 'first_name': 'Newman', 'last_name': '', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Reverse Peephole'},
    {'quote': 'I have spent a lot of time, and I have eaten a lot of crap to get to where I am today. And I am NOT throwing it all away now.', 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Strike'},
    {'quote': 'Oh yeah? I’ll tell you what’s stupid. You. Stupid.', 'first_name': 'David', 'last_name': 'Puddy', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Dealership'},
    {'quote': "We couldn't carry on a conversation. I kept trying to picture her naked, she kept trying to not picture me naked.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Apology'},
    {'quote': "When you cough, there are thousands of unseen muscles that suddenly spring into action. It's like watching that fat guy catch a cannonball in his stomach in slow motion.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Apology'},
    {'quote': "Well, the female body is a...work of art. The male body is utilitarian, it's for gettin' around, like a Jeep.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Apology'},
    {'quote': 'You can stuff you sorries in a sack, mister!', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Betrayal'},
    {'quote': "All right, George, all right. I'm sorry. I'm very, very sorry. I'm so sorry that I didn't want your rather bulbous head struggling to find its way through the normal-size neck hole of my finely knit sweater.", 'first_name': 'Jason "Stanky"', 'last_name': 'Hanke', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Apology'},
    {'quote': "I'll tell you a little secret about zip codes: They're meaningless!", 'first_name': 'Newman', 'last_name': '', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Betrayal'},
    {'quote': "That reminds me of the Haitian Voodoo rattle torture! You haven't gone over to their side, have you?", 'first_name': 'J.', 'last_name': 'Peterman', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Merv Griffin Show'},
    {'quote': "I've seen moles so big they have their own moles. Freckles that cover two men.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Slicer'},
    {'quote': "Well, I just stomped some pigeons in the park. They—they didn't move.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Merv Griffin Show'},
    {'quote': "You're in trouble, Kramer. I shouldn't even be talking to you, but I'm telling you as a friend. Here's how it's going to happen: You may be walking. Maybe on a crisp, autumn day just like today. When a mail truck will slow beside you and a door will open, and a mailman you know, maybe even trust, will offer to give you a lift.", 'first_name': 'Newman', 'last_name': '', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Junk Mail'},
    {'quote': 'You call yourself a lifesaver. I call you pimple popper MD!', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Slicer'},
    {'quote': "George, we've had it with you. Understand? We love you like a son, but even parents have limits.", 'first_name': 'Frank', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Junk Mail'},
    {'quote': "Oh yeah, you've got three pints of Kramer in you, buddy.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Blood'},
    {'quote': "Jerry, I know myself. If I'm out on the street and it starts to go down, I don't back off until it's finished.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Blood'},
    {'quote': "You've got ‘shiksappeal.’ Jewish men love the idea of meeting a woman that's not like their mother.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Serenity Now'},
    {'quote': '1%? They can kiss 1% of my ass!', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Serenity Now'},
    {'quote': "Doctor gave me a relaxation cassette. When my blood pressure gets too high, the man on the tape tells me to say, 'Serenity now!'", 'first_name': 'Frank', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Serenity Now'},
    {'quote': 'Serenity now. Insanity later.', 'first_name': 'Lloyd', 'last_name': 'Braun', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Serenity Now'},
    {'quote': "What's the deal with lampshades? I mean if it's a lamp, why do you want shade?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Butter Shave'},
    {'quote': "I can't take this anymore! I don't want to hear how interesting the change with the hole in it is! And if you tell me what time it is in New York again, you are going home in a body bag!", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Butter Shave'},
    {'quote': "Jerry, let's face it, I've always been handicapped. I'm just now getting the recognition for it. Name one thing I have that puts me in a position of advantage. Huh? There was a guy that worked at the Yankees—no arms! He got more work done than I did, made more money, had a wife, a family, drove a better car than I did.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 9, 'episode': 'The Butter Shave'},
    {'quote': "What's the deal with airplane peanuts?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Summer of George'},
    {'quote': "Because men think if women are grabbing and clawing at each other there's a chance they might somehow kiss.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Summer of George'},
    {'quote': "Because they're terrified of her. I heard from someone that when they cut one of her lines, she climbed up the rope on side of the stage and started dropping lights on people’s heads. Story like that has got to be true.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Summer of George'},
    {'quote': "I know what you thought. They don't have homes, they don't have jobs, what do they need the top of a muffin for? They're lucky to get the stumps.", 'first_name': 'Rebecca', 'last_name': '', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Muffin Tops'},
    {'quote': 'Frolf: Frisbee golf, Jerry. Golf with a Frisbee. This is gonna be my time. Time to taste the fruits and let the juices drip down my chin. I proclaim this: The Summer of George!', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Summer of George'},
    {'quote': "The last thing this guy's qualified to give a tour of is reality.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Muffin Tops'},
    {'quote': "It's the best part. It's crunchy, it's explosive, it's where the muffin breaks free of the pan and sort of does its own thing. I'll tell you. That's a million-dollar idea right there. Just sell the tops.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Muffin Tops'},
    {'quote': 'If you can call it that. Why is it every halfwit and sitcom star has his own book out now?', 'first_name': 'Mr.', 'last_name': 'Lippman', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Muffin Tops'},
    {'quote': "Elaine, these ideas are all in the air. They're in the air.", 'first_name': 'Mr.', 'last_name': 'Lippman', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Muffin Tops'},
    {'quote': "We wanna look to the future, we gotta tear down the past. Babe Ruth was nothing more than a fat old man, with little-girl legs. And here's something I just found out recently. He wasn't really a sultan. Ah, what d'you make of that? Hey, check this out. Lou Gehrig's pants. Not a bad fit. Hey, you don't think that nerve disease of his was contagious, do you? Uh, I better take ’em off. I'm too important to this team. Big Stein can't be flopping and twitching.", 'first_name': 'George', 'last_name': 'Steinbrenner', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Millennium'},
    {'quote': "It's taken me thirteen years to climb up to the top of that speed dial, and I don't intend to lose my spot to you.", 'first_name': 'Mrs.', 'last_name': 'Hamilton', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Millennium'},
    {'quote': 'All right. I guess I just have to pick myself up, dust myself off, and throw myself right back down again!', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Millennium'},
    {'quote': 'So you want to go out in a final blaze of incompetence?', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Millennium'},
    {'quote': "You're a rabid anti-dentite! Oh, it starts with a few jokes and some slurs. ‘Hey, denty!’ Next thing you know you're saying they should have their own schools.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Yada Yada'},
    {'quote': "Don't you see what Whatley is after? Total joke-telling immunity. He's already got the two big religions covered, if he ever gets Polish citizenship, there'll be no stopping him.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Yada Yada'},
    {'quote': "Mother Nature's a mad scientist, Jerry.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Yada Yada'},
    {'quote': "Speaking of exes, my old boyfriend came over late last night, and, yada yada yada, anyway. I'm really tired today.", 'first_name': 'Marcy', 'last_name': '', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Yada Yada'},
    {'quote': "I'll tell you why. Because I believe Whatley converted to Judaism just for the jokes.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Yada Yada'},
    {'quote': 'Just let me ask you something. Is it ‘FebRUary’ or ‘FebUary’? Because I prefer ‘FebUary,’ and what is this ‘ru’?', 'first_name': 'George', 'last_name': 'Steinbrenner', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Nap'},
    {'quote': "Well, we were engaged to be married, uh, we bought the wedding invitations, and, uh, yada yada yada, I'm still single.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Yada Yada'},
    {'quote': "Because I'm REFRESHED. I finally found a way to sleep in my office. Under the desk. I lie on my back. I tuck in the chair. I'm invisible.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Nap'},
    {'quote': "Look, let me just state for the record: I think you're both better than me.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The English Patient'},
    {'quote': "It's like, if one of ’em dies, the other one wants to bench-press the casket.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The English Patient'},
    {'quote': "Oh, you think you're better than me? Go ahead, pick out anything in the room here. I'll lift it up over my head.", 'first_name': 'Izzy', 'last_name': 'Mandelbaum Jr.', 'show': 'Seinfeld', 'season': 8, 'episode': 'The English Patient'},
    {'quote': "Oh yeah, that's right. Go. Put us all in the hospital. And you've ruined our business with all your macho head games.", 'first_name': 'Izzy', 'last_name': 'Mandelbaum', 'show': 'Seinfeld', 'season': 8, 'episode': 'The English Patient'},
    {'quote': "Think you're better than me, huh?", 'first_name': 'Izzy', 'last_name': 'Mandelbaum', 'show': 'Seinfeld', 'season': 8, 'episode': 'The English Patient'},
    {'quote': "If she can't find me, she can't break up with me.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Susie'},
    {'quote': "Jerry, you have tendencies. They're always annoying, but they were just tendencies. But now, if you can't kiss this girl, I'm afraid we're talking disorder.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Pothole'},
    {'quote': 'There you are, Elaine. Go forth and create. And, by the way, when you get to that chapter about my romantic escapades—feel free to toss yourself in the mix.', 'first_name': 'J.', 'last_name': 'Peterman', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Van Buren Boys'},
    {'quote': "I don't think I'll ever be able to forget Susie—ahhh. And most of all, I will never forget that one night. Working late on the catalog. Just the two of us. And we surrendered to temptation. And it was pretty good.", 'first_name': 'J.', 'last_name': 'Peterman', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Susie'},
    {'quote': "The ocean called. They're running outta shrimp.", 'first_name': 'Reilly', 'last_name': '', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Comeback'},
    {'quote': 'This is my one chance to make a great entrance! My whole life, I have never made a great entrance!', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Susie'},
    {'quote': "Yeah, because you're perfect. You're a calculating, coldhearted businesswoman. And when there's dirty work to be done, you don't mind stomping on a few throats.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Comeback'},
    {'quote': 'I had a dream last night that a hamburger was eating me!', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Van Buren Boys'},
    {'quote': 'Sometimes in life, the gods smile upon you, my friends.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Comeback'},
    {'quote': 'Trust me, Kramer. Given the legal opportunity, I will kill you.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Comeback'},
    {'quote': "You were completely right. I sleep so much better when I'm alone. And you scream in your sleep.", 'first_name': 'Emily', 'last_name': '', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Money'},
    {'quote': "Listen to the comeback. ‘Oh yeah? Well the jerk store called. They're running outta you.’", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Comeback'},
    {'quote': "As much as I'd like to see the two of you living it up in a warm, tropical setting, I, I would just miss you too much. So I've decided I want you to stay.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Money'},
    {'quote': "I couldn't get there in time to stop it, but you should have seen Little Jerry, Jerry! Flappin' his wings and struttin' his stuff! He was peckin' and weavin' and bobbin' and talkin' trash! He didn't even have to touch him! The other rooster ran out of the ring. The whole fight lasted two seconds.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Little Jerry'},
    {'quote': "Jerry, it's three-thirty in the morning. I'm at a cockfight. What am I clinging to?", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Little Jerry'},
