    {'quote': 'In closing, these stories have not been embellished, because they need no embellishment. They are simply, horrifyingly, the story of my life as a short, stocky, slow-witted bald man.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Andrea Doria'},
    {'quote': "I can't be with someone who doesn't break up nicely. I mean, to me, that's one of the most important parts of a relationship.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Andrea Doria'},
    {'quote': "I found out he's a bad breaker-upper…you know when you break up, how you say things you don't mean? Well, he says the mean things you don't mean, but he means them.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Andrea Doria'},
    {'quote': "To Hawaii. The most sought-after postal route of them all. The air is so dewy-sweet you don't even have to lick the stamps. But it's not to be, so I'm hanging it up.", 'first_name': 'Newman', 'last_name': '', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Andrea Doria'},
    {'quote': 'There must be something exciting about this guy if he can arouse that kind of passion.', 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Andrea Doria'},
