    {'quote': 'Jerry, my face is my livelihood, my allure...my twinkle! Everything I have I owe to this face.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Abstinence'},
    {'quote': "To a woman, sex is like the garbage man. You just take for granted the fact that any time you put some trash out on the street, a guy in a jumpsuit's gonna come along and pick it up. But now, it's like a garbage strike. The bags are piling up in your head. The sidewalk is blocked. Nothing's getting through. You're stupid.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Abstinence'},
    {'quote': "I mean, let's say this is your brain. OK, from what I know about you, your brain consists of two parts: the intellect, represented here, and the part obsessed with sex. Now, granted, you have extracted an astonishing amount from this little scrap. But with no-sex—Louise, this previously useless lump is now functioning for the first time in its existence.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Abstinence'},
