    {'quote': 'Inchon, Korea, 1950. I was the best cook Uncle Sam ever saw, slinging hash for the Fighting 103rd. As we marched north, our supply lines were getting thin. One day a couple of GIs found a crate, inside were six hundred pounds of prime Texas steer. At least it once was prime. The use date was three weeks past, but I was arrogant, I was brash, I thought if I used just the right spices, cooked it long enough...', 'first_name': 'Frank', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Fatigues'},
    {'quote': "People with guns don't understand. That's why they get guns. Too many misunderstandings.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 8, 'episode': 'The Little Kicks'},
