    {'quote': "Here's what I wanna do. I wanna overhaul the entire engine. But it's gonna take a major commitment from you. You're gonna have to keep it under sixty miles an hour for a while. You gotta come in, and you gotta get the oil changed every thousand miles.", 'first_name': 'Tony', 'last_name': '', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Bottle Deposit'},
