    {'quote': "So let me ask you a question about the tip jar. I had a little thing with the calzone guy this week. I go to drop a buck in the tip jar and just as I am about to drop it in he looks the other way. And then when I am leaving he gives me this look think thanks for nothing. I mean, if they don't notice it what's the point?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Calzone'},
    {'quote': "When I find something I like, I stick with it. From 1973 to 1982 I ate the exact same lunch every day: turkey chili in a bowl made out of bread. Bread bowl, George. First you eat the chili then you eat the bowl. There's nothing more satisfying than looking down after lunch and seeing nothing but a table.", 'first_name': 'George', 'last_name': 'Steinbrenner', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Calzone'},
    {'quote': "I don't understand this. Why wouldn't you want to get something that's better if I'm telling you it's better? And it's not a little better—it's much better.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Doll'},
    {'quote': "Well perhaps he thinks that you're working him for the discount. Shaking that little butt of yours into big, big savings....And then when you get it, you know, you drop him like a hot potato.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Wig Master'},
    {'quote': "Swinging? What are you, out of your mind? Look at you, you're disgusting. You're bald, you're paunchy, all kinds of sounds are emanating from your body twenty-four hours a day. If there's a woman that can take your presence for more than ten consecutive seconds, you should hang on to her like grim death—which is not far off, by the way.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Shower Head'},
    {'quote': "Oh, I'm percolating, Jerry. I'm telling you, I have never felt so fertile. I'm mossy, Jerry. My brain is mossy. Listen to this idea: a restaurant that serves only peanut butter and jelly.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Friars Club'},
    {'quote': "It's disgusting. I'm sitting there in a tepid pool of my own filth. All kinds of microscopic parasites and organisms having sex all around me.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Shower Head'},
    {'quote': "I know what you're going through. I too once fell under the spell of opium. It was 1979. I was travelling the Yangtze in search of a Mongolian horsehair vest. I had got to the market after sundown. All of the clothing traders had gone, but a different sort of trader still lurked about. ‘Just a taste,’ he said. That was all it took.", 'first_name': 'J.', 'last_name': 'Peterman', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Shower Head'},
    {'quote': "Yeah, I got some family backstage. Course my family's nuts; they're crazy. Yep. My uncle Leo. I had lunch with him the other day, he's one of these guys that anything goes wrong in life, he blames it on anti-Semitism. You know what I mean, the spaghetti's not al dente? Cook's an anti-Semite. Loses a bet on a horse. Secretariat? Anti-Semitic. Doesn't get a good seat at the temple. Rabbi? Anti-Semite.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Shower Head'},
    {'quote': "OK, look. We've never worked together on a lie. Now, you don't understand how I work. I have a certain way of working. Jerry and I have worked together a few times. He knows how I work. It's not a personal thing, y'know? We're just trying to come up with the best possible lie. That's what this is all about.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Cadillac'},
    {'quote': "All right. Anyway, the point I was making before Goebbels made your hamburger is a man like you could be dating women twenty years younger. C'mon, Uncle Leo, I've seen the way women look at you. When's the last time you looked in a mirror? You're an Adonis! You've got beautiful features, lovely skin, you're in the prime of your life here, you should be swinging. If I were you I'd tell this Lydia character, ‘It's been real,’ move back into that bachelor pad and put out a sign: Open for business.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Shower Head'},
    {'quote': "Look, I got a few good years left. If I want a Chip Ahoy, I'm having it.", 'first_name': 'Morty', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Cadillac'},
    {'quote': "I'm not force-feeding myself a steak at four-thirty to save a couple of bucks, I'll tell you that.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Cadillac'},
    {'quote': "Oh, it's got cachet, baby! It's got cachet up the yin-yang.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Seven'},
    {'quote': "Seven? Yeah, I guess I could see it. Seven. Seven periods of school, seven beatings a day. Roughly seven stitches a beating, and eventually seven years to life. Yeah, you're doing that child quite a service.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Seven'},
    {'quote': "That's totally inappropriate. It's lewd, lascivious, salacious, outrageous.", 'first_name': 'Jackie', 'last_name': 'Chiles', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Caddy'},
    {'quote': "Let me understand, you got the hen, the chicken and the rooster. The rooster goes with the chicken. So who's having sex with the hen?", 'first_name': 'Frank', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Rye'},
    {'quote': "That's the bra I gave her, she's wearing it as a top! The woman is walking around in broad daylight with nothing but a bra on. She's a menace to society.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Caddy'},
    {'quote': "Look, honey, I know you're trying to get Lloyd to notice you, but this is too much. Parading around in a wet T-shirt.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Gum'},
