    {'quote': "Well, we've gone out several times, we obviously have a good rapport. I own a very profitable electronics-distributing firm. I eat well. I exercise. Blood tests—immaculate. And if I can speak frankly, I'm actually quite good at it.", 'first_name': 'Billy', 'last_name': '', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Sponge'},
