    {'quote': "Elaine, can I just explain something to you very privately here? Susan and I have been together many, many times now, and just between you and me, there's really no big surprises here, so...makeup sex is all that I have left.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Sponge'},
