    {'quote': "If I date a taking person, everyone's taking, taking, taking, no one's giving—it's bedlam.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Sponge'},
    {'quote': "Ah, you have no idea of the magnitude of this thing. If she is allowed to infiltrate this world, then George Costanza as you know him ceases to exist! You see, right now, I have Relationship George, but there is also Independent George. That's the George you know, the George you grew up with—Movie George, Coffee Shop George, Liar George, Bawdy George….If Relationship George walks through this door, he will Kill Independent George! A George divided against itself cannot stand!", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Pool Guy'},
    {'quote': 'This is not good. Worlds are colliding! George is getting upset.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Pool Guy'},
