    {'quote': "The Rogue's Wallet. That's where he kept his card, his dirty little secret. Short, devious, balding. his name was Costanza. He killed my mother.", 'first_name': 'J.', 'last_name': 'Peterman', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Secret Code'},
    {'quote': 'Mothers say things. My mother goes babbling on and on like a crazy person.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Secret Code'},
    {'quote': "Why does everything have to be 'us'? Is there no 'me' left? Why can't there be some things just for me? Is that so selfish?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Secret Code'},
