    {'quote': "He's not a Nazi. He just happens to be a little eccentric. Most geniuses are.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Soup Nazi'},
    {'quote': "Oh, we all get a little cuckoo sometimes, George. I used to be like you. Rating personnel ’tll they cried, calling managers on the field during a game, threatening to move the team to New Jersey, just to upset people. Then I found a way to relax. I've got two words to say to you, George: hot tub.", 'first_name': 'George', 'last_name': 'Steinbrenner', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Hot Tub'},
