    {'quote': "Ohhh, I'm exhausted. I've been on this street a thousand times! It's never looked so strange! The faces...so cold! In the distance, a child is crying. Fatherless...a bastard child, perhaps. My back aches...my heart aches...but my feet...my feet are resilient! (Thank God I took off my heels, and put on my...HIMALAYAN WALKING SHOES!", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Hot Tub'},
    {'quote': "I always look annoyed. Yeah, when you look annoyed all the time, people think that you're busy.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Hot Tub'},
    {'quote': "I'd rather be dating the blind. You know you could let the house go. You could let yourself go. A good-looking blind woman doesn't even know you're not good enough for her.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Wink'},
    {'quote': "You put the balm on? Who told you to put the balm on? I didn't tell you to put the balm on. Why'd you put the balm on? You haven't even been to see the doctor. If you’re gonna put a balm on, let a doctor put a balm on.", 'first_name': 'Jackie', 'last_name': 'Chiles', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Maestro'},
    {'quote': "Yeah, that's going to be a problem. It's gonna be a problem for them. This a clear violation of your rights as a consumer. It's an infringement on your constitutional rights. It's outrageous, egregious, preposterous.", 'first_name': 'Jackie', 'last_name': 'Chiles', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Maestro'},
    {'quote': "A young lady I know, let's call her Elaine, happened to find herself overwhelmed with feelings of resentment and hostility for her friend, let's call him George. She felt that George was somewhat of a loser and that she was the one who deserved to be married first. She also happened to mention to me that her friend had wondered if going to a prostitute while you're engaged is considered cheating. His feeling was they're never going to see each other again so what's the difference?", 'first_name': 'Rabbi', 'last_name': 'Glickman', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Postponement'},
    {'quote': "You didn't have makeup sex? How could you not have makeup sex? I mean that's the best feature of the heavy relationship.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Postponement'},
    {'quote': "It's very difficult. Few men have the constitution for it. That's why breakups take two or three tries. You gotta build up your immunity.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Postponement'},
    {'quote': "You see those tears streaming down, you don't know what to do. It was like she was on fire and I was trying to put her out.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Postponement'},
    {'quote': "Spring. Rejuvenation. Rebirth. Everything's blooming. All that crap.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Postponement'},
    {'quote': "It can never be erased. It'll follow us wherever we go for the rest of our lives. I'll never be able to get a job. I mean, doesn't that concern you? Everything I've worked for...down the drain because of one stupid mistake. I mean, aren't we entitled to make one mistake in our lives, Jerry?", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Postponement'},
    {'quote': "They're prisons. Manmade prisons. You're doing time. You get up in the morning. She's there. You go to sleep at night. She's there. It's like you gotta ask permission to use the bathroom. ‘Is it all right if I use the bathroom now?’", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Engagement'},
    {'quote': 'I will never understand the bathrooms in this country. Why is it that the doors on the stalls do not come all the way down to the floor?', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Postponement'},
    {'quote': "And you broke up with her 'cuz she beat you at chess? That's pretty sick.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Engagement'},
    {'quote': "Well, look at it this way. We drop the dog off in front of somebody's house in the country. They find it and adopt it. Now the dog is prancing in the fields. Dancing and prancing. Fresh air. Dandelions. We're doing this dog a real favor.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Engagement'},
    {'quote': "OUR LIVES! What kind of lives are these? We're like children. We're not men.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 7, 'episode': 'The Engagement'},
    {'quote': "Then in the distance I heard the bulls. I began running as fast as I could. Fortunately, I was wearing my Italian Captoe Oxfords. Sophisticated yet different; nothing to make a huge fuss about. Rich dark brown calfskin leather. Matching leather vent. Men's whole and half sizes 7 through 13. Price: $135.00.", 'first_name': 'J.', 'last_name': 'Peterman', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Understudy'},
    {'quote': 'Oh, understudies are a very shifty bunch. The substitute teachers of the theater world.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Understudy'},
    {'quote': "Anyway, I um, I just want to say that I'm sorry. I lost my temper and I probably shouldn't have. I took it out on you and, look, if I've caused you any problems as a result of my behavior, well then, I'm sorry. I apologize. Even though, Barry, between me and you, we both know that you started it. I mean, who's kidding who? But they tell me that you're very upset, and God forbid I should disturb the very important monkey, I'm just hoping we can put this behind us, let's just move on with our lives, OK? So, no hard feelings?", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Face Painter'},
    {'quote': 'So, my dear, you think you can get to Broadway. Well, let me tell you something. Broadway has no room for people like you. Not the Broadway I know. My Broadway takes people like you and eats them up and spits them out.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Understudy'},
    {'quote': "No one is touching my feet. Between you and me, Elaine, I think I've got a foot odor problem.", 'first_name': 'Frank', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Understudy'},
    {'quote': "Jerry, this is the way society functions. Aren't you a part of society? Because if you don't want to be a part of society, Jerry, why don't you just get in your car and move to the East Side?", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Face Painter'},
    {'quote': "You have any idea how fast these things deteriorate when there's an ‘I love you’ out of the bag? You can't have a relationship where one person says, ‘I love you’ and the other says, ‘I'm hungry. Let's get something to eat.’", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Face Painter'},
    {'quote': "Hey, how come people don't have dip for dinner? Why is it only a snack, why can't it be a meal, you know? I don't understand stuff like that.", 'first_name': 'David', 'last_name': 'Puddy', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Face Painter'},
    {'quote': "Yeah, except you don't really have any black friends. Outside of us, you don't have any white friends, either.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': "The Diplomat's Club"},
    {'quote': "I mean, now she thinks that I'm one of these guys that love her.  Nobody wants to be with somebody that loves them.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Face Painter'},
    {'quote': "He stopped short? That's my move. I'm gonna kill him!", 'first_name': 'Frank', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Fusilli Jerry'},
    {'quote': "Take toilet paper, for example. Do you realize that toilet paper has not changed in my lifetime? It's just paper on a cardboard roll, that's it.  And in ten thousand years, it will still be exactly the same because really, what else can they do?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Face Painter'},
    {'quote': "Now, the ending is kind of an option. I use the swirl. I like the swirl. I'm comfortable with the swirl. I feel the swirl is a great capper. He uses the pinch, which I find a little presumptuous.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Fusilli Jerry'},
    {'quote': 'Well, all those mechanics do is work all day with their hands and their big, muscular arms on machines, and then they come home dripping with animal sexuality like Stanley Kowalski. What a huge turnoff that is.', 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Fusilli Jerry'},
    {'quote': "Have you ever met a proctologist? Well, they usually have a very good sense of humor. You meet a proctologist at a party, don't walk away. Plant yourself there, because you will hear the funniest stories you've ever heard. See, no one wants to admit to them that they stuck something up there. Never! It's always an accident. Every proctologist story ends in the same way: ‘It was a million to one shot, Doc. Million to one.’", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Fusilli Jerry'},
    {'quote': 'You see Elaine, Billy was a simple country boy. You might say a cockeyed optimist who got himself mixed up in the high stakes game of world diplomacy and international intrigue.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Doodle'},
    {'quote': "You're not out there! You can't be, because I am out there. And if I see you out there, there's not enough voltage in this world to electroshock me back into coherence!", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Fusilli Jerry'},
    {'quote': "I waited all year for this. Oooh, this is fantastic. Makes your taste buds come alive. It's like having a circus in your mouth.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Doodle'},
    {'quote': 'You know, I went out once with a nude model. Never let me see her naked. Hundreds of people see her naked every week, except me. Needless to say, it was quite vexing.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Doodle'},
    {'quote': "You see the thing of it is, there's a lot of ugly people out there walking around, but they don't know they're ugly, because nobody actually tells them.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Doodle'},
    {'quote': "You know that just admitting a man is handsome doesn't necessarily make you a homosexual.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Jimmy'},
    {'quote': "Well, let’s see what I have today. Darn it. It's ham and cheese again and she forgot the fancy mustard. I told her I like that fancy mustard. You could put that fancy mustard on a shoe and it would taste pretty good to me. Oh! She made it up with a cupcake, though. Hey look at this. You know, I got a new system for eating these things. I used to peel off the chocolate now I turn them upside down. I eat the cake first and save the frosting for the end.", 'first_name': 'George', 'last_name': 'Steinbrenner', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Jimmy'},
    {'quote': 'Jimmy’s gonna get you, Kramer! Hands off Jimmy! Don’t touch Jimmy! Let go of Jimmy!', 'first_name': 'Jimmy', 'last_name': '', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Jimmy'},
    {'quote': "You know, selling bras exclusively to women, we're really only utilizing fifty percent of the market.", 'first_name': 'Sid', 'last_name': 'Farkus', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Doorman'},
    {'quote': "Cold showers? They're for psychotics.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Jimmy'},
    {'quote': 'Hey George, what do you like better? The ‘bro’ or the ‘mansiere’?', 'first_name': 'Frank', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Doorman'},
    {'quote': 'I lived with him for forty years, I never saw him trying on my underwear. As soon as he leaves the house, he turns into J. Edgar Hoover!', 'first_name': 'Estelle', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Doorman'},
    {'quote': "You really think you're better than me, don't you?", 'first_name': 'The', 'last_name': 'Doorman', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Doorman'},
    {'quote': "You should be thanking me for liberating you from your world of loneliness and isolation. Now you're part of a family.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Kiss Hello'},
    {'quote': "A bra is for ladies. I'm talking about a support undergarment specifically designed for men.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Doorman'},
    {'quote': "If everybody knew everybody, we wouldn't have the problems we have in the world today. Well, you don't rob somebody if you know their name!", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Kiss Hello'},
    {'quote': "I tell you, when she threw that toupee out the window, it was the best thing that ever happened to me. I feel like my old self again. Totally inadequate, completely insecure, paranoid, neurotic, it's a pleasure.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Beard'},
    {'quote': "I got rejected by a bald woman. A bald woman rejected me. Heh, you like that one? A woman with no prospects and no hair told me that I wasn't her type. Apparently, Baldie likes a slimmer guy.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Beard'},
    {'quote': "Elaine, do you know what you've done? You've give hope to every woman who's ever said, ‘Too bad he's gay.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Beard'},
    {'quote': "All you people with hair think you're so damn superior! You have no idea what it's like. You ever look down in the bottom of your tub and see a fist fulla hair? How'd you like to start your day with that?", 'first_name': 'Toupee', 'last_name': 'Salesman', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Scofflaw'},
    {'quote': "You don't think I know how you're feeling, every second of the day? Looking over your shoulder to see if someone's coming up from behind. Sitting alone at night, knowing they could be closing in.", 'first_name': 'Newman', 'last_name': '', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Scofflaw'},
    {'quote': "You think you can get him to just change teams? He's not going to suddenly switch sides. Forget about it.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Beard'},
    {'quote': "Yeah, well I don't trust this guy. I think he regifted, he degifted, and now he's using an upstairs invite as a springboard to a Super Bowl sex romp.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Label Maker'},
    {'quote': "Kramer, you don't understand. He made the last contact between us. I had the upper hand in the post-breakup relationship. If he thinks that I said hi, then I lose the upper hand.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Scofflaw'},
    {'quote': "I think this is the same one I gave him. He recycled this gift. He's a regifter!", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Label Maker'},
    {'quote': "Mr. Kramer, let me tell you a story. In nineteen-seventy-nine I ticketed a brown Dodge Diplomat for parking in a church zone. That fine was never paid, and since then that scofflaw has piled up more parking tickets than anyone in New York City. For sixteen years I pursued him, only to see him give me the slip time and time again. I never got a clean look at his face, but he's become my ‘white whale.’ Mr. Kramer, that day was yesterday! But thanks to you, I don't know if I'll ever get that chance again!", 'first_name': 'Officer', 'last_name': 'Morgan', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Scofflaw'},
    {'quote': 'Do you ever just get down on your knees and thank God that you know me and have access to my dementia?', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Switch'},
    {'quote': "The point is I intend to undertake this. And I'll do it with or without you. So if you're scared, if you haven't got the stomach for this, let's get it out right now! And I'll go on my own. If not, you can get onboard and we can get to work! Now, what's it going to be?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Switch'},
    {'quote': "Well you know all my life I've been running away from that name. That's why I wouldn't tell anybody. But I've been thinking about it. All this time I'm trying not to be me. I'm afraid to face who I was. But I'm Cosmo, Jerry. I'm Cosmo Kramer. And that's who I'm going to be. From now on that's who I'm going to be. I'm Cosmo!", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Switch'},
    {'quote': "Don't you know what it means to become an orgy guy? It changes everything. I'd have to dress different. I'd have to act different. I'd have to grow a mustache and get all kinds of robes and lotions and I'd need a new bedspread and new curtains I'd have to get thick carpeting and weirdo lighting. I'd have to get new friends. I'd have to get orgy friends.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Switch'},
    {'quote': "Because I haven't talked to my mother in five years. We just don't see eye to eye. I don't even want to get into my childhood. I'm still carrying a lot of pain. A LOT of pain.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Switch'},
    {'quote': "Good, Merry Christmas, George. And bring me back some of those cigars in the cedar boxes, you know the ones with the fancy rings? I love those fancy rings. They kind of distract you while you're smoking. The red and yellow are nice. It looks good against the brown of the cigar. The Maduro, I like the Maduro wrapper. The darker, the better, that's what I say. Of course, the Claro's good, too. That's more of a pale brown, almost like a milky coffee. I find the ring size very confusing. They have it in centimeters which I don't really understand that well...", 'first_name': 'George', 'last_name': 'Steinbrenner', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Race'},
    {'quote': "Well, you really got bald there, didn't you?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Race'},
    {'quote': "Sure, I like a cupcake every now and then, like everybody else. You know I like it when they have a little cream on the inside, it's a surprise. That's good, plus the chocolate ones are good, too. Sometimes I just can’t even make up my mind. A lot of times I’ll mix the two together, make a vanilla fudge.", 'first_name': 'George', 'last_name': 'Steinbrenner', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Secretary'},
    {'quote': "Just because you're a communist, does that mean you can't wear anything nice? You look like Trotsky. It's gorgeous. Fine, you want to be a communist, be a communist. Can't you at least look like a successful communist?", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Race'},
    {'quote': "You're luscious. You're ravishing. I would give up red meat just to get a glimpse of you in a bra. I’m terribly sorry.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Secretary'},
    {'quote': "I don't even know what, what is supposed to be attractive about fur? Why does a man want to see a woman in a fur? Men want women to shave their legs, shave their armpits, pluck their eyebrows and then before we go out, we dress them up like a bear.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Secretary'},
    {'quote': 'In four years of high school I would never race anyone again. Not even to the end of the block to catch a bus. And so the legend grew. Everyone wanted me to race. They begged me. The track coach called my parents. Pleading. Telling them it was a sin to waste my God-given talent. But I answered him in the same way I answered everyone: ‘I choose not to run.’', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Race'},
    {'quote': "Because you're a bunch of yuppies. It's your go-go corporate takeover lifestyles that are driving out these Mom and Pop stores and destroying the fabric of this neighborhood.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Mom & Pop Store'},
    {'quote': "Listen Jerry, I've been doing some thinking. I want my suit back.", 'first_name': 'Kenny', 'last_name': 'Bania', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Soup'},
    {'quote': "Yeah, that's a deal. That's a horrible deal. I don't want to go out to dinner with him. I’d rather make my own suit.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Soup'},
    {'quote': 'My father used to take me to the circus. When the elephants came by, he would scream curses at them, blaming them for all the ills of society.', 'first_name': 'Katya', 'last_name': '', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Gymnast'},
    {'quote': 'Well, you, my friend, have crossed the line that divides man and bum. You are now a bum.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Gymnast'},
    {'quote': "I’m just saying there's a chance she may not have been enamored with your thoughts and feelings on manure.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Soup'},
    {'quote': 'My mother was taken from my house by the communists in the middle of the night when I was ten years old. She was sent to a slave labor camp, where she labored for twelve years. Finally, they released her and she was on a boat to America to reunite with us...but she was served some bad fish, and she died on the high seas.', 'first_name': 'Poppie', 'last_name': '', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Couch'},
    {'quote': "A gymnast, Jerry. Think of the flexibility. Mmm, that sex'll melt your face.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Gymnast'},
    {'quote': 'Is it...? Could it...? Could he have...? IT IS! Poppie peed on my sofa!', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Couch'},
    {'quote': "You know, everybody listens to the Chinese. I mean, look at the fortune cookie. You couldn't get away with that in any other restaurant.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Chinese Woman'},
    {'quote': "I'm out there, Jerry, and I'm lovin' every minute of it!", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Chinese Woman'},
    {'quote': "Boxers! How do you wear these things!! Look at that—they're baggin' up, they're rising in! And there's nothing holding me in place! I'm flippin'! I'm floppin'!", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Chinese Woman'},
    {'quote': 'If I like their race, how can that be racist?', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Chinese Woman'},
    {'quote': "It's a pizza place where you make your own pie! We give you the dough, the sauce, the cheese...you pound it, slap it, you flip it up into the air...you put your toppings on and you slide it into the oven! Sounds good, huh?", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Couch'},
    {'quote': "Your Nana is missing because she's been passing those bum checks all over town and she finally pissed off the wrong people.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Pledge Drive'},
    {'quote': "You know, if it was a regular salad I wouldn't have said anything. But you had to have the BIG SALAD!", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Big Salad'},
    {'quote': "You know, I think I could have played with dolls if there were dolls in the house. It seems like fun to me. It doesn't seem like a gender thing. I think I would like to play with dolls. What's so terrible?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Big Salad'},
    {'quote': "I've looked into his eyes. He's pure evil.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Big Salad'},
    {'quote': 'You know, you buy a big salad for somebody, it would be nice if they knew it.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Big Salad'},
    {'quote': "I want a decent sock that's comfortable, that will stay on my foot!", 'first_name': 'Justin', 'last_name': 'Pitt', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Chaperone'},
    {'quote': "Well, you don't want too much grace or you won't be able to stand.", 'first_name': 'Justin', 'last_name': 'Pitt', 'show': 'Seinfeld', 'season': 6, 'episode': 'The Chaperone'},
    {'quote': "A job with the New York Yankees! This has been the dream of my life ever since I was a child, and it's all happening because I'm completely ignoring every urge towards common sense and good judgment I've ever had. This is no longer just some crazy notion. Jerry, this is my religion.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 5, 'episode': 'The Opposite'},
