    {'quote': "To me, the thing about birthday parties is that the first birthday party you have and the last birthday party you have are actually quite similar. You know, you just kinda sit there...you're the least excited person at the party. You don't even really realize that there is a party. You don't know what's goin' on.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 5, 'episode': 'The Fire'},
