    {'quote': "Darling, you see where that glass is? How that glass is near the edge of the table. You got the whole table there to put the glass, why you chose the absolute edge, so half the glass is hanging off the table, you breathe and that glass falls over, then you're gonna have broken glass on the carpet, embedded in the carpet fibers, deep, deep in the shag, broken glass, bits of broken glass that you never get out. You can't get it out with a vacuum cleaner. Even on your hands and knees with a magnifying glass, you can't get all the pieces, and then you think you got it all and two years later, you're walkin' barefoot and you step on a piece of broken glass and you kill yourself, is that what you want?", 'first_name': 'The', 'last_name': 'Mohel', 'show': 'Seinfeld', 'season': 5, 'episode': 'The Bris'},
