    {'quote': "The female orgasm is kinda like the bat cave. A very few people know where it is and if you're lucky enough to see it you probably don't know how you got there and you can't find you way back after you left. You know there are two types of female orgasm: the real and the fake. And I'll tell you right now, as a man, we don't know. We do not know, because to man sex is like a car accident and determining the female orgasm is like being asked 'What did you see after the car went out of control?' 'I heard a lot of screeching sounds. I remember I was facing the wrong way at one point. And in the end my body was thrown clear.'", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 5, 'episode': 'The Mango'},
    {'quote': "Let me give you a word of advice. OK? I want you to stay away from me. I don't wanna talk to you, and I don't wanna hear any more of your stupid little notes and suggestions. I don't like you. So if you got any other problems whether it's raisins, prunes, figs, or any other dried fruit, just keep it to yourself and stay out of my way, OK?", 'first_name': 'Tom', 'last_name': 'Pepper', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pilot'},
