    {'quote': 'How would you like it if I just pulled your heart out of your chest right now and shoved it down your throat?', 'first_name': 'Tom', 'last_name': 'Pepper', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pilot'},
    {'quote': "I'm calling for my test results. Negative? Oh, my God. WHY! WHY! WHY? What? What? Negative is good? Oh, yes of course! How stupid of me. Thank you.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pilot'},
