    {'quote': "You know the message you're sending out to the world with these sweatpants? You're telling the world: ‘I give up. I can't compete in normal society. I'm miserable, so I might as well be comfortable.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pilot'},
    {'quote': "I can't die with dignity. I have no dignity. I want to be the one person who doesn't die with dignity. I live my whole life in shame. Why should I die with dignity?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pilot'},
