    {'quote': 'She dumped me! She rolled right over me! Said I was a hipster doofus. Am I a hipster doofus?', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Handicap Spot'},
    {'quote': 'I love the name ‘Isosceles.’ If I had a kid, I would name him Isosceles. Isosceles Kramer.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Handicap Spot'},
    {'quote': "Why do we need B.O.? What is the function of it? Everything in nature has a reason, has a purpose, except B.O. Doesn't make any sense—do something good, hard work, exercise, smell very bad. This is the way the human being is designed. You move, you stink. Why can't our bodies help us? Why can't sweat smell good? It'd be a different world, wouldn't it? Instead of putting your laundry in the hamper, you'd put it in a vase.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Smelly Car'},
    {'quote': "Amazing. I drive them to lesbianism, he brings 'em back.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Smelly Car'},
    {'quote': "Don't you understand what I'm saying to you? This is not just an odor—you need a priest to get rid of this thing.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Smelly Car'},
    {'quote': "You don't understand what I'm up against. This is a force more powerful than anything you can imagine. Even Superman would be helpless against this kind of stench.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Smelly Car'},
    {'quote': "Y’know, the funny thing is, somehow I find her more appealing now. It's like if I knew she was a lesbian when we went out, I never would've broken up with her.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Smelly Car'},
    {'quote': 'Do I smell something? What am I, hard of smelling? Of course I smell something.', 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Smelly Car'},
    {'quote': "A lesbian sighting. Oh-ho! My lucky day. They're so fascinating. Why is that? Because they don't want us. You gotta respect that.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Smelly Car'},
    {'quote': "Who's gonna turn down a Junior Mint? It's chocolate, it's peppermint—it's delicious.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Junior Mint'},
    {'quote': "Who are you to play God? Every man's time comes! If his number is up, who are you to interfere?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Junior Mint'},
    {'quote': "He was a fat starving artist, y’know. That's very rare.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Junior Mint'},
    {'quote': "Well, that's the positive thing about getting sick, you get to lose weight.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Junior Mint'},
    {'quote': "I think you're both mentally ill. And by the way...they're real, and they're spectacular.", 'first_name': 'Sidra', 'last_name': '', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Implant'},
    {'quote': "A leg man? Why would I be a leg man? I don't need legs. I have legs.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Implant'},
    {'quote': "You dipped the chip. You took a bite. And you dipped again. That's like putting your whole mouth right in the dip! From now on, when you take a chip—just take one dip and end it.", 'first_name': 'Timmy', 'last_name': '', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Implant'},
    {'quote': 'I would like to dip my bald head in oil and rub it all over your body.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Old Man'},
    {'quote': "Yeah, I'm a great quitter. It's one of the few things I do well. I come from a long line of quitters. My father was a quitter, my grandfather was a quitter. I was raised to give up.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Old Man'},
    {'quote': "Because the mail never stops. It just keeps coming and coming and coming, there's never a let-up. It's relentless. Every day it piles up more and more and more! And you gotta get it out but the more you get it out the more it keeps coming in. And then the bar code reader breaks and it's Publishers Clearing House day.", 'first_name': 'Newman', 'last_name': '', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Old Man'},
    {'quote': "I think I'm pretty much like you—only successful.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Old Man'},
    {'quote': "Oh her. She steals from me. Steals my money. She says she doesn't speak English. My ass she doesn't speak English. Plays that freakin’ voodoo music, tries to hypnotize me. She thinks she's gonna turn me into a zombie and then rob me blind. Well, I wasn't born yesterday. I may drop dead today, but I sure as hell wasn't born yesterday.", 'first_name': 'Sid', 'last_name': '', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Old Man'},
    {'quote': "Oh, what's the point? When I like them, they don't like me, when they like me, I don't like them. Why can't I act with the ones I like the same way I do with the ones I don't like?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Old Man'},
    {'quote': "I am not gay. I am, however, thin, single, and neat. Sometimes when someone is thin, single, and neat people assume they are gay because that is a stereotype. They normally don't think of gay people as fat, sloppy, and married. Although I'm sure there are, I don't want to perpetuate the stereotype. I'm sure they are the minority though within the gay community.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Outing'},
    {'quote': "Y’know, there are tribes in Indonesia where if you keep your coat on in somebody's house, the families go to war.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Outing'},
    {'quote': "There's been a big misunderstanding here! We did that whole thing for your benefit. We knew you were eavesdropping. That's why my friend said all that. It was on purpose! We're not gay! Not that there's anything wrong with that.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Outing'},
    {'quote': "I don't know about you, but I'm getting sick of pretending to be excited every time it's somebody's birthday, you know what I mean? What is the big deal? How many times do we have to celebrate that someone was born? Every year, over and over. All you did was not die for twelve months. That's all you've done, as far as I can tell. Now those astrology things where they tell you all the people that have the same birthday as you? It's always an odd group of people too, isn't it? It's like Ed Asner, Elijah Muhammad, and Secretariat.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Outing'},
    {'quote': "Divorce is very difficult. Especially on a kid. Of course, I'm the result of my parents having stayed together, so you never know.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Shoes'},
    {'quote': 'Because I snubbed her. You see? Women, they like that! Yes! I understand women. The snub is good, they love the snub.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Shoes'},
    {'quote': "Looking at cleavage is like looking at the sun: You don't stare at it. It's too risky. You get a sense of it and then you look away.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Shoes'},
    {'quote': "I am for open immigration but that sign we have on the front of the Statue of Liberty, ‘Give us your tired, your poor, your huddled masses...,’ can't we just say, ‘Hey, the door's open, we'll take whoever you got’? Do we have to specify the wretched refuse? I mean, why don't we just say, ‘Give us the unhappy, the sad, the slow, the ugly, people that can't drive, that they have trouble merging, if they can't stay in their lane, if they don't signal, they can't parallel park, if they're sneezing, if they're stuffed up, if they're clogged, if they have bad penmanship, don't return calls, if they have dandruff, food between their teeth, if they have bad credit, if they have no credit, missed a spot shaving, in other words any dysfunctional, defective slob that you can somehow cattle-prod onto a wagon, send them over, we want 'em.'", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Visa'},
    {'quote': "I'm going to save up every rupee. Someday I will get back to America, and when I do I will exact vengeance on this man. I cannot forget him. He haunts me. He is a very bad man. He is a very, very bad man.", 'first_name': 'Babu', 'last_name': 'Bhatt', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Visa'},
    {'quote': "But, but I'm disturbed! I'm depressed! I'm inadequate! I got it all!", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Visa'},
    {'quote': "Well, with so many people in the world deprived and unhappy, it doesn't seem like it would be fair to be cheerful.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Visa'},
    {'quote': "Dark and disturbed? His whole life revolves around Superman and cereal. I convinced him to act like that so that you would think I was funnier. That's how disturbed I am! If you want disturbed, that's disturbed. You can't find sickness like that anywhere, you think sickness like that grows on trees? Nobody is sicker than me, nobody. He's pretending; I'm the genuine article.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Visa'},
    {'quote': "Well, birthdays are merely symbolic of how another year has gone by and how little we've grown. No matter how desperate we are that someday a better self will emerge, with each flicker of the candles on the cake, we know it's not to be, that for the rest of our sad, wretched, pathetic lives, this is who we are to the bitter end. Inevitably, irrevocably; happy birthday? No such thing.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Visa'},
    {'quote': "You see, this is what I do with women. I start out too strong, now I have to become real, that's when it all falls apart. What good is real? They don't want real, they want funny.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Visa'},
    {'quote': "Maybe you don't have to be so funny. I mean, would it kill you not to be so funny all the time? That's all I'm asking. This woman thinks I'm very funny. Now you're gonna be funny, so what am I gonna be? I'm gonna be a short bald guy with glasses who suddenly doesn't seem so funny.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Visa'},
    {'quote': "Kramer goes to a fantasy camp. His whole life is a fantasy camp. People should plunk down two thousand dollars to live like him for a week. Do nothing, fall ass-backwards into money, mooch food off your neighbors, and have sex without dating; that's a fantasy camp.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Visa'},
    {'quote': 'Oh, hey, listen, by the way, have you seen a tall...lanky...doofus with a, with a bird face and hair like the Bride of Frankenstein?', 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Movie'},
    {'quote': "What are lawyers, really? To me a lawyer is basically the person that knows the rules of the country. We're all throwing the dice, playing the game, moving our pieces around the board, but if there's a problem, the lawyer is the only person that has read the inside of the top of the box. I think one of the fun things for them is to say, ‘objection.’ ‘Objection! Objection, Your Honor.’ Objection, of course, is the adult version of, ‘’fraid not.’ To which the judge can say two things, he can say, ‘overruled’ which is the adult version of ‘’fraid so,’ or he could say, ‘sustained,’ which is the adult version of ‘Duh.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Visa'},
    {'quote': "Could you do me a favor? If you see a guy that's five-foot-eleven, he's got, uh, a big head and flared nostrils, tell him his friend's going to be right back, OK?", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Movie'},
    {'quote': "You know, men can sit through the most boring movie if there's even the slightest possibility that a woman will take her top off.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Movie'},
    {'quote': 'Um, excuse me, have you see a guy with like a horse face, big teeth, and, uh, and a pointed nose?', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Movie'},
    {'quote': 'You know, I try to take care of myself. I—I watch what I eat. Ah, just recently I cut out fructose.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pick'},
    {'quote': 'You think Louie Pasteur and his wife had anything in common? He was in the fields all day with the cows, you know with the milk, examining the milk, delving into milk, consumed with milk. Pasteurization, Homogenization. She was in the kitchen killing cockroaches with a boot on each hand.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pick'},
    {'quote': "I'm not stable? I'm like a rock. I take these glasses off, you can't tell the difference between me and a rock. I put these glasses on a rock. You know what jumps into most people's minds? Costanza.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pick'},
    {'quote': "I guarantee you that Moses was a picker. You wander through the desert for forty years with that dry air. You telling me you're not going to have occasion to clean house a little bit?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pick'},
    {'quote': 'Now what does the little man inside you say? See you gotta listen to the little man.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pick'},
    {'quote': "CALVIN KLEIN? No, no. That's my idea. They, they stole my idea. You see I had the idea of a cologne that makes you smell like you just came from the beach.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pick'},
    {'quote': "I like flying. I like those little bathrooms that they have on the plane. It's kind of like a small apartment of your own on the plane. You go in, you close the door, the light comes on. It's like a small surprise party every time you go in there.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Airport'},
    {'quote': "Oh, look at this. He's sleeping and I have to go to the bathroom. Maybe he'll wake up soon. What if my kidneys burst? Is it worth it not to wake this man up to damage a major organ? I hope this disgusting slob appreciates what I'm doing for him.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Airport'},
    {'quote': "A beautiful successful intelligent woman's in love with me, and I throw it all away. Uh-oh boy. Now I'll spend the rest of my life living alone. I'll sit in my disgusting little apartment watching basketball games, eating Chinese take-out. Walking around with no underwear. Because I'm too lazy to do a laundry.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pick'},
    {'quote': "No, no, no, no. You can't! You can't! This is something that comes about once in a lifetime! When we were boys, looking through our bedroom windows, we would think: ‘Why can't there be a woman out there, taking her clothes off?’ And now that wish has come true, and you want to throw it away?", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Contest'},
    {'quote': "I can't take it anymore! She's driving me crazy! I can't sleep, I can't leave the house, and I’m here, I'm climbin’ the walls. Meanwhile, I'm dating a virgin, I'm in this contest—something's gotta give.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Contest'},
    {'quote': "We have to do it. It's part of our lifestyle. It's like, uh…shaving.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Contest'},
    {'quote': "I don't understand you. I really don't. You have nothing better to do at three o’clock in the afternoon? I go out for a quart of milk, I come home, and find my son treating his body like it was an amusement park!", 'first_name': 'Estelle', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Contest'},
    {'quote': "Listen, I wouldn't put too much stock into what Elaine has to say about relationships. She comes from a broken home, and I mean that literally. A tree fell on her roof and cracked the whole structure. Her parents got along beautifully, but her house was in bad shape.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Virgin'},
    {'quote': "This whole sex thing is totally overrated. Now, here's the one thing you've gotta be ready for is how the man changes into a completely different person five seconds after it's over. I mean, something happens to their personality; it's really quite astounding. It's like they committed a crime and they want to flee the scene before the police get there.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Virgin'},
    {'quote': "Yeah, since she met him she's been vomited on, her family cabin's been burned down, she learned her father's a homosexual, and she got fired from a high-paying network job. Yeah, they had a real good thing going.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Virgin'},
    {'quote': "You know, they always remember the first time. I don't want to be remembered. I wanna be forgotten.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Virgin'},
    {'quote': "Would you believe my luck? The first time in my life I have a good answer to the question, ‘What do you do?’ and I have a girlfriend. I mean, you don't need a girlfriend when you can answer that question. That's what you say in order to get girlfriends. Once you can get a girlfriend, you don't want a girlfriend, you just want more girlfriends.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Virgin'},
    {'quote': "I had some friends drag me to an opera recently, you know how they've got those little opera glasses, you know, do you really need binoculars, I mean how big do these people have to get before you can spot 'em? These opera kids they're going two-fifty, two-eighty, three-twenty-five, they're wearing big white woolly vests, the women have like the breastplates, the bullet hats with the horn coming out. If you can't pick these people out, forget opera, think about optometry, maybe that’s more your thing.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Opera'},
    {'quote': "The idea behind the tuxedo is the woman's point of view that men are all the same, so we might as well dress them that way. That's why a wedding is like the joining together of a beautiful glowing bride and some guy. The tuxedo is a wedding safety device created by women because they know that men are undependable. So in case the groom chickens out, everybody just takes one step over and she marries the next guy. That’s why the wedding vow isn't ‘do you take Bill Simpson?’; it’s ‘Do you take this man?’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Opera'},
    {'quote': "The hardest part about being a clown, it seems to me, would be that you're constantly referred to as a clown. ‘Who was that clown?,’ ‘I'm not working with that clown, did you hire that clown?,’ ‘The guy's a clown!’ How do you even start into being a clown, how do you know that you want to be a clown, I guess you get to a point where your pants look so bad, it's actually easier to become a clown than having the proper alterations done. Because if you think about it, a clown, if there isn't a circus around them, is really just a very annoying person. You're in the back seat of this guy’s Volkswagen, ‘What, you're picking somebody else up? Oh, man!’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Opera'},
    {'quote': "‘Dear Henry, last night with you was bliss. I fear my orgasm has left me a cripple. I don't know how I shall ever get back to work. I love you madly, John. P.S.: Loved the cabin.’", 'first_name': 'Susan', 'last_name': 'Ross', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Cheever Letters'},
    {'quote': "Do I think you're a clown? No, not if it’s bad to be a clown, if it’s bad to be a clown then you are definitely not a clown. But if it’s good to be a clown then, you know, I would have to rethink the whole thing.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Opera'},
    {'quote': "I love that place. My father built that cabin in 1947. My mother was recuperating from impetigo at the time, and dad thought it would be a good idea to get her out into the fresh air. She died there the following winter. And he passed away 10 years later to the day. His last words to me were, ‘Cherish the cabin.’ Not, uh, ‘Take care of your sister. She's a paraplegic.’ But, ‘Cherish the cabin.’ And I have. For 45 years. It's often been a sanctuary for me.", 'first_name': 'Mr.', 'last_name': 'Ross', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Cheever Letters'},
    {'quote': "How come the psychiatrist, every, the hour is only fifty minutes? Wha, what do they do with that ten minutes that they have left? Do they just sit there going, ‘Boy, that guy was crazy. I couldn't believe the things he was saying. What a nut! Who's coming in next? Oh, no, another head case!’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Watch'},
    {'quote': "Poor little Bubble Boy. He's sitting there waiting for you in his bubble, or igloo thing or whatever.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Bubble Boy'},
    {'quote': "Doesn't like you? How can anyone not like you?", 'first_name': 'Helen', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Wallet'},
    {'quote': "You could be a fireman on a fire truck on the way to a fire. You bump into one of my relatives. ‘I'm sorry Uncle Leo, there's a building full of people burning down. I really do have to be running.’ He'll go: ‘Go. Go ahead. Go to your fancy fire. If that's what you have to do.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Ticket'},
    {'quote': "We're lucky they are even interested in the idea in the first place. We got a show about nothing. With no story. What do you think, they're up there going, ‘maybe we should give those two guys, who have no experience and no idea, more money’?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Wallet'},
    {'quote': 'Vomiting is not a deal-breaker. If Hitler had vomited on Chamberlain, Chamberlain still would have given him Czechoslovakia.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pitch'},
    {'quote': "I don't even want to talk about it anymore. What were you thinking? What was going on in your mind? Artistic integrity? Where, where did you come up with that? You're not artistic and you have no integrity. You know you really need some help. A regular psychiatrist couldn't even help you. You need to go to like Vienna or something. You know what I mean? You need to get involved at the university level. Like where Freud studied and have all those people looking at you and checking up on you. That's the kind of help you need. Not the once a week for eighty bucks. No. You need a team. A team of psychiatrists working ’round the clock thinking about you, having conferences, observing you, like the way they did with the Elephant Man. That's what I'm talking about, because that's the only way you're going to get better.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pitch'},
    {'quote': 'I think I can sum up the show for you with one word: NOTHING.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pitch'},
    {'quote': "They're men with jobs, Jerry! They wear suits and ties. They're married, they have secretaries.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pitch'},
    {'quote': "Everybody's doing something; we'll do nothing.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pitch'},
    {'quote': "OK, uh, look, if you want to just keep on doing the same old thing, then maybe this idea is not for you. I, for one, am not going to compromise my artistic integrity. And I'll tell you something else, this is the show and we're not going to change it.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pitch'},
    {'quote': "We had a deal. Are you reneging out of the deal? Are you reneging? That's a renege.", 'first_name': 'Newman', 'last_name': '', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pitch'},
    {'quote': "What do you want me to say? That the things haven't worked out the way that I planned? That I'm struggling, barely able to keep my head above water? That LA is a cold place even in the middle of the summer? That it's a lonely place even when you’re stuck in traffic on the Hollywood Freeway? That I'm no better than a screenwriter driving a cab, a starlet turning tricks, a producer in a house he can't afford? Is that what you want me to say?", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': "Do? Do? Hey, I'm doing what I do. You know, I've always done what I do. I'm doing what I do, the way I've always done and the way I'll always do it.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': "Come on, this is a great idea. Look at the characters. You've got all these freaks on the show. A woman with a mustache? I mean, who wouldn't tune in to see a woman with a mustache? You've got the tallest man in the world, a guy who's just a head.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Pitch'},
    {'quote': "I'm not interested in your explanations, Kramer! Sure, I bet you've got a million of ’em. Maybe your mother didn't love you enough, maybe the teacher didn't call on you in school when you had your little hand raised, maybe the pervert in the park had a present in his pants, huh? Well, I've got another theory, Kramer: You're a weed.", 'first_name': 'Lieutenant', 'last_name': 'Martel', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': "Oh yeah, right. Maybe it was one of your other personalities, huh? The wise guy, the little kid, the bellhop, the ball player, maybe the door-to-door vacuum cleaner salesman, but not you right? No, you wouldn't hurt a fly. You just couldn't help yourself, could you, Kramer? You saw life brimming brightly with optimism and verve, and you just had to snuff it out.", 'first_name': 'Lieutenant', 'last_name': 'Martel', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': "I hate asking for change. They always make a face. Like I'm asking them to donate a kidney.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': "Fabulous, just fabulous. I've got a lot of auditions, a lot of callbacks, and I've got a lot of interest for my movie treatment. I'm in development, I'm in developed vehicles. And there's a lot of energy here, man. You know, the vibe, it's powerful. I'm just swept up at it. Yeah, I'm a player.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': "There are many different jobs in the police. It seems to me, that the chalk outline guy is one of the better jobs that you can get. You know it's not dangerous, the criminals are long gone, that seems like a good one. I don't know who they are, I guess they're people who wanted to be sketch artists, but they couldn't draw too well...‘Listen, Johnson, forget the sketches. Do you think if we left a dead body right there on the sidewalk, you could manage to trace around it? Could you do that?’ I don't even know how it helps to solve the crime? You know, they look at the thing on the ground...‘Aah. his arm was like that when he hit the pavement. That means the killer must've been Jim.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': "What am I scared of? I'm scared of the same thing that you are, everything.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': 'What was it like having sex with Adolf Hitler? What do you wear in a bunker? What did her parents think of Hitler as a potential son-in-law? I mean, it could just go on and on.', 'first_name': 'Chelsea', 'last_name': '', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': "It was an old cat. It died of natural causes. So get this, now she tells me that I gotta buy her a brand-new cat. I say listen, honey. First of all, it was a pretty old cat. I'm not gonna buy you a brand-new cat to replace an old dying cat. And second of all, I go out to the garbage, I find you a new cat in fifteen seconds. I say, you show me an autopsy report that says this cat died of starvation, I spring for a new cat. So she says something to me, like, uh, I dunno, get the hell out of here, and she breaks up with me.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': "Yes, I like to just be able to take the blankets and swish them and swirl them, you know what I mean? You know, I don't like being all tucked in. I like to have a lot of room, you know I like to have my toes pointed up in the air. Just like to scrunch up the blankets.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': 'I happen to dress based on mood.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': "So my acting technique, my personal acting technique is working with color, imagining color, then finding the emotional vibrational mood connected to the color. See, if you look through my scripts, you'll see that all my lines have a special color, so I don't memorize language, I memorize color. This way I can go through red, yellow, green, blue. And I have a full palette of emotions.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 4, 'episode': 'The Trip'},
    {'quote': 'I was living in twilight, George. Living in the shadows. Living in the darkness...like you.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Keys'},
    {'quote': "People will kill each other for a parking space in New York because they think, 'If I don't get this one, I may never get a space.’ You know? ‘I'll be circling for months until somebody goes out to the Hamptons.’ I think because everyone in New York City knows there's gotta be way more cars than parking spaces. You see cars driving in New York all hours of the night. It's like musical chairs, except everybody sat down around 1964.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Space'},
    {'quote': "No, no, this is a matter of principle. That would just be saying that anybody could just pull into any parking space any way they want. Well I'm making a stand here. I'm saying ‘no’ to head-first parking. I'm not putting up with that. We put up with too much crap in this city, we're not putting up with head-first parking.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Space'},
    {'quote': "You don't understand. A garage. I can't even pull in there. It's like going to a prostitute. Why should I pay, when if I apply myself, maybe I could get it for free?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Space'},
    {'quote': "What is it about sleep that makes you so thirsty? Do dreams require liquid? It's not like I'm running a marathon, I'm just lying there.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Keys'},
    {'quote': "Because I'm like ice, buddy. When I don't like you, you've got problems.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Space'},
    {'quote': "The appeal of the posse? The posse has tremendous appeal. Get away from the job, camp out, you're with your friends....Come on, it's a week-long game of hide-and-seek on horseback.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Letter'},
    {'quote': "He is a loathsome, offensive brute, yet I can't look away.", 'first_name': 'Mr.', 'last_name': 'Armstrong', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Letter'},
    {'quote': 'You know what I would like to do? I would really like to have sex with a tall woman. I mean really tall. Like a like a giant Like six-five.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Boyfriend'},
    {'quote': "It's not so much the looking as the listening. I listen for work. And as I'm looking and listening I am also looking. You can't discount looking. It's sort of a combination. It's looking and listening, listening and looking. But you must look.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Boyfriend'},
    {'quote': "She missed her period? Oh my god. I can't believe it! I'm a father! I did it! My boys can swim! I can do it! I can do it!", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Fix-Up'},
    {'quote': "What's the matter with you? Now don't you two see that you're in love with each other? I mean, why can't you face that already? You're running around out there looking for something that's not even there, when everything that you dream of is right here, right here in front of you.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Fix-Up'},
    {'quote': "I left three messages. I can't believe this woman. She has sex with me, leaves ten minutes later, then I never hear from her again. What kind of a person does this? I mean, she used me. I feel cheap and violated.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Fix-Up'},
    {'quote': "Well, let me tell you something about George. He is fast. He can run like the wind. And he's strong. I've seen him lift a hundred pounds over his head without even knowing it. And you wouldn't know it to look at him, but George can bait a hook.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Fix-Up'},
    {'quote': "I don't want hope. Hope is killing me. My dream is to become hopeless. When you're hopeless, you don't care, and when you don't care, that indifference makes you attractive.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Fix-Up'},
    {'quote': "I've never assisted in a birth before. It’s really quite disgusting.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Suicide'},
    {'quote': 'How long do you have to wait for a guy to come out of a coma before you ask his ex-girlfriend out?', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Suicide'},
    {'quote': "I mean the problem is that the good ones know they're good. And they know they're in such demand they're just not interested in confining themselves to one person.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Fix-Up'},
    {'quote': "A preemptive breakup. This is an incredible idea. I got nothing to lose. We either break up, which she would do anyway, but at least I go out with some dignity. Completely turn the tables. It's absolutely brilliant.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pez Dispenser'},
    {'quote': 'I don’t get you. Who goes on vacation without a job? What do you need a break from getting up at eleven?', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Suicide'},
    {'quote': "Lunch is fine at the beginning, then you move on to dinner. You don't move back to lunch. It's like being demoted.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pez Dispenser'},
    {'quote': 'The thing I don’t understand about the suicide person is the people who try and commit suicide for some reason they don’t die and that’s it. They stop trying. Why? Why don’t they just keep trying? What has changed? Is their life any better now? No. In fact, it’s worse because now they’ve found out one more thing you stink at. OK, that’s why these people don’t succeed in life to begin with. Because they give up too easy. I saw, pills don’t work, try a rope. Car won’t start in the garage, get a tune-up. You know what I mean? There’s nothing more rewarding than reaching a goal you have set for yourself.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Suicide'},
    {'quote': "I'm very uncomfortable. I have no power. I mean, why should she have the upper hand. Once in my life I would like the upper hand. I have no hand—no hand at all. She has the hand; I have no hand.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pez Dispenser'},
    {'quote': 'You know I got a great idea for a cologne. The Beach. You spray it on and you smell like you just came home from the beach.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pez Dispenser'},
    {'quote': "I get the feeling when lesbians are looking at me, they're thinking: ‘That's why I'm not heterosexual.’", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Subway'},
    {'quote': "Make myself comfortable. What does that mean? Does she want me to take my clothes off? Is she taking her clothes off? What if I take my clothes off and she still has hers on? Then I really look like an idiot. She could get offended and leave. So maybe I should leave them on, but what then if she takes her off? Then she'll feel humiliated. ‘Make yourself comfortable.’ I got this unbelievable woman and this ‘comfortable’ thing can ruin me. I got it! I take my shoes off and sit on the bed. There, that's comfortable. She can't accuse me being uncomfortable.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Subway'},
    {'quote': "I hate being around alcoholics because they're either telling you how much they love you or how much they hate you. And those are the two statements that scare me the most.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Red Dot'},
    {'quote': "I think the best part of a relationship is when you're sick. And the best part of being sick is when you're in a relationship. And if I was to get married, you know all those vows; for richer or for poorer, for better or for worse, all I need is the sickness. That, to me, is the most important one. Do you take this man in sickness? That's the only time I need somebody there. Rest of the time, go out, have a ball, do whatever you want, but if I get the sniffles, you better be there.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Alternate Side'},
    {'quote': "So we started drinking, and I'll tell you I don't know if it was the alcohol or the ammonia, but the next think I knew she was mopping the floor with me.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Red Dot'},
    {'quote': "I never feel comfortable in the women's department. I feel like I'm just a little too close to trying on a dress.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Red Dot'},
    {'quote': 'Can you die from an odor? I mean, like if you were locked in a vomitorium for two weeks, could you actually die from the odor?', 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Alternate Side'},
    {'quote': "So I'm sitting there with Woody and I say, I turn to him and I go, ‘Boy, these pretzels are making me thirsty.’", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Alternate Side'},
    {'quote': "I don't like when a woman says, ‘Make love to me.’ It's intimidating. The last time a woman said that to me, I wound up apologizing to her.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Stranded'},
    {'quote': 'Maybe the dingo ate your baby.', 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Stranded'},
    {'quote': "See, you know how to take the reservation, you just don't know how to HOLD the reservation and that's really the most important part of the reservation—the holding. Anybody can just take them.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Alternate Side'},
    {'quote': 'What could possess anyone to throw a party? I mean, to have a bunch of strangers treat your house like a hotel room.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Stranded'},
    {'quote': "The technical term for a nose job is rhinoplasty. Rhino, okay? Do we really need to insult the person at this particular moment of their lives? They know they have a big nose, that's why they're coming in. Do they really need the abuse of being compared to a rhinoceros on top of everything else? When someone goes in for a hair transplant, they don't go, ‘We're going to perform a cue-ballectomy on you, Mr. Johnson. We're going to attempt to remove the skinheadia of your chrome-domus, which is the technical term.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Nose Job'},
    {'quote': "I can always tell when a woman likes me, they always somehow let you know. With me, they could torture me, I wouldn't tell them. If anything I'd try to make them think I don't like them, then they think, ‘Oh, look at this guy, he's not even looking at me, he must have something going for him.’", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Stranded'},
    {'quote': "Look at you! Look at what you've sunk to! Look at what you've become! Look in the mirror, ’cause you need help, Jerry. You need help, because I can't stand by and do it anymore. It's turning my stomach! I can't stand around here watching you destroy yourself. It's eating me up inside.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Nose Job'},
    {'quote': "I have never been so repulsed by someone mentally and so attracted to them physically at the same time. It's like my brain is facing my penis in a chess game. And I'm letting him win.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Nose Job'},
    {'quote': "You haven't won. You may think you've won, but you haven't won. Do you know why? It's not over. This is not over. I'm not forgetting what's happening here. You have my ten dollars. I will get it back. All right, don't worry. It's not over. I'm going now. Goodbye. I will be back.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Stranded'},
    {'quote': "I mean, I should be grateful someone like her even looks at me. I have no job, nothing. But I have to say, I think about the nose. I don't want to think about the nose. I don't ask to think about the nose, but I think about it. I go to bed at night, I tell myself, ‘Don't think about the nose, forget the nose,’ but I think about it. I look at her, I see nose.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Nose Job'},
    {'quote': "No baldness; it'd be like a nation of Supermen.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Tape'},
    {'quote': 'You bad man! You very, very bad man.', 'first_name': 'Babu', 'last_name': 'Bhatt', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Cafe'},
    {'quote': "Doesn't the fat fetish conflict with the minimalism?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Tape'},
    {'quote': 'Very good? No, not very good, very great. I am very, very great.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Cafe'},
    {'quote': 'Quiet! You shut up! You make me change restaurant, but nobody comes! You say make Pakistani, Babu Bhatt have only Pakistani restaurant. But where are people? You see people? Show me people. There are no people.', 'first_name': 'Babu', 'last_name': 'Bhatt', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Cafe'},
    {'quote': "I am such a great guy. Who else would've gone through the trouble of helping this poor immigrant? I am special. My mother was right. Of course, I've never had Pakistani food. How bad it could be?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Cafe'},
    {'quote': "You should've seen her face. It was the exact same look my father gave me when I told him I wanted to be a ventriloquist.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Cafe'},
    {'quote': "You know, people think I'm smart, but I'm not smart.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Cafe'},
    {'quote': "Very kind. I am a kind man. Who else would do something like this? Nobody. Nobody thinks about people like I do. All right, snap out of it, you stupid jerk. You're eating a turkey sandwich. What do want, a Nobel Prize?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Cafe'},
    {'quote': "She thinks I'm a nice guy. Women always think I'm nice, but women don't like nice….Why is nice bad? What kind of sick society we are living in, when nice is bad?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Cafe'},
    {'quote': "It's like a spider in the toilet struggling for a survival. And even if you know it's not going to make it, you kind of root it for a while.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Cafe'},
    {'quote': 'Boy, those Scientologists. They can be pretty sensitive.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Garage'},
    {'quote': 'I once saw this thing on TV with people who are terminally ill. And they all believed the secret of life is just to live every moment.', 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Garage'},
    {'quote': "There's always that one location, one store location that's constantly changing hands. Everybody has this in their neighborhood, it's a leather store, it's a yogurt shop, it's a pet supply. It's constantly changing and nobody can do business there. It's like some sort of Bermuda Triangle of retail, you know? Stores open up and then they just disappear without a trace. Nobody knows what happened to 'em. I guess eventually when like aliens land in mother ship of close encounters, bottom will slowly open and all these store owners will come wondering out in a daze going 'I thought there would be more walk-in traffic didn't you?'", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Cafe'},
    {'quote': "I should've hit the little son-of-a-bitch. I can't stand kids. Adults think it's so wonderful how honest kids are. I don't need that kind of honesty. I'll take a deceptive adult over an honest kid any day.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Garage'},
    {'quote': "I can't carry a pen. I'm afraid I'll puncture my scrotum.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Garage'},
    {'quote': "Because I could get uromysitisis poisoning and die. That's why!...Do you think I enjoy living like this?...the shame, the humiliation...You know I have been issued a public urination pass by the city because of my condition. Unfortunately my little brother ran out of the house with it this morning.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Garage'},
    {'quote': "Why do I always have the feeling that everybody's doing something better than me on Saturday afternoons?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Garage'},
    {'quote': "Parents never forget a foul-up. I once left a jacket on the bus when I was fourteen. Last week I'm flying to Chicago to do a show, ‘Make sure you hang on to your jacket.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Parking Garage'},
    {'quote': 'That is one tough monkey.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "It was a weird school day, you know what I mean because it kind of like started off kind of normal. You have like English, Geometry, Social Studies and then suddenly you're like in 'Lord of The Flies' for 40 minutes you know you're hangin' from a rope. You have hardly any clothes on. Teachers are yellin' at you: ‘Where's your jock strap?’ You know and kids are throwin' dodge balls at you. You're tryin' to survive....Then it’s History, Science, Language. There's something off in the entire flow of that day.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "What's my problem? Punks like you, that's my problem. And you better not screw up again Seinfeld, because if you do, I'll be all over you like a pit bull on a poodle.", 'first_name': 'Lieutenant', 'last_name': 'Bookman', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "I remember when the librarian was a much older woman: Kindly, discreet, unattractive. We didn't know anything about her private life. We didn't WANT to know anything about her private life. She didn't HAVE a private life.", 'first_name': 'Lieutenant', 'last_name': 'Bookman', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "You know, the library is kind of a cool place when it's closed.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': 'Hard feelings? What do you know about hard feelings? You ever have a man die in your arms? You ever kill somebody?', 'first_name': 'Lieutenant', 'last_name': 'Bookman', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "Well, let me tell you something, funny boy. Y'know that little stamp, the one that says ‘New York Public Library’? Well that may not mean anything to you, but that means a lot to me. One whole hell of a lot. Sure, go ahead, laugh if you want to. I've seen your type before: Flashy, making the scene, flouting convention. Yeah, I know what you're thinking. What's this guy making such a big stink about old library books? Well, let me give you a hint, junior. Maybe we can live without libraries, people like you and me. Maybe. Sure, we're too old to change the world, but what about that kid, sitting down, opening a book, right now, in a branch at the local library and finding drawings of pee-pees and wee-wees on the Cat in the Hat and the Five Chinese Brothers? Doesn't HE deserve better? Look. If you think this is about overdue fines and missing books, you'd better think again. This is about that kid's right to read a book without getting his mind warped! Or maybe that turns you on, Seinfeld; maybe that's how you get your kicks. You and your good-time buddies. Well I got a flash for ya, joy-boy: Party time is over.", 'first_name': 'Lieutenant', 'last_name': 'Bookman', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "We just tease someone 'til they develop an eating disorder.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "Yeah, '71. That was my first year on the job. Bad year for libraries. Bad year for America. Hippies burning library cards, Abbie Hoffman telling everybody to steal books. I don't judge a man by the length of his hair or the kind of music he listens to. Rock was never my bag. But you put on a pair of shoes when you walk into the New York Public Library, fella.", 'first_name': 'Lieutenant', 'last_name': 'Bookman', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "You buy a jar of Folger's Crystals, you put it in the cupboard, you forget about it. Then later on when you need it, it's there. It lasts forever. It's freeze-dried. Freeze-dried Crystals.", 'first_name': 'Lieutenant', 'last_name': 'Bookman', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': 'He made me smell my own gym socks once.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "Look at her. This is a lonely woman looking for companionship....Spinster...Maybe a virgin....Maybe she got hurt a long time ago. She was a schoolgirl. There was a boy. It didn't work out. Now she needs a little tenderness. She needs a little understanding. She needs a little Kramer.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "It's all a bunch of cheapskates in there anyway. People sitting around reading the newspaper attached to huge wooden sticks. Trying to save a quarter, ooh.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Library'},
    {'quote': "I have nothing to say to anybody. I'm so uninteresting. I think I'm out of conversation.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Dog'},
    {'quote': "I must have been out of my mind. Look at you. Why don't you do something with your life? Sit around here all day, you contribute nothing to society. You're just taking up space. How could I be with someone like you? Couldn't respect myself.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Dog'},
    {'quote': "On my block, a lot of people walk their dogs, and I always see them walking along with their little poop bags, which to me is just the lowest function of human life. If aliens are watching this through telescopes, they're gonna think the dogs are the leaders. If you see two life forms, one of them's making a poop, the other one's carrying it for him, who would you assume was in charge?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Dog'},
    {'quote': "Please! Please!! I take it all back, everything! I take it all back, every word! I love you! I love YOU! I can't live without you, I'll do anything.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Dog'},
    {'quote': "No, it's like BO and cologne, they combine forces into some kind of strange mutant funk.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Dog'},
    {'quote': 'If you could see her personality it would be like one of the Elephant Man exhibits, you know where they pull off the sheet and everyone gasps.', 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Dog'},
    {'quote': "You know how there's some people you worry about whether you're going to hurt their feelings? With her, I'm looking forward to it. I'd like to get it on video, watch it in slow motion and freeze-frame it. Oh ho, yeah.", 'first_name': 'Cosmo', 'last_name': 'Kramer', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Dog'},
    {'quote': "Do you believe this? Do you believe what I'm dealing with here? I've got a wild animal in the house! He's deranged, maybe he's got rabies. I can get lockjaw.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Dog'},
    {'quote': "So I'm on the plane, we left late. Pilot says we're going to be making up some time in the air. I thought, well isn't that interesting? We'll just make up time. That's why you have to reset your watch when you land. Of course, when they say they're making up time, obviously they're increasing the speed of the aircraft. Now, my question is if you can go faster, why don't you just go as fast as you can all the time? C'mon, there's no cops up here. Nail it. Give it some gas! We're flying.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Dog'},
    {'quote': "Is Florida not hot and muggy enough for these people? They love heat. I mean if they ever decide to land men on the sun, I think these old retired guys would be the only ones that will be able to handle it. They'll just sit there on the sun, on the redwood benches, washcloth on the head going: ‘Close the door, you're letting all the heat off the sun. I'm trying to get a sweat going.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pen'},
    {'quote': "You need some new material. I've heard you do that dog routine three times already.", 'first_name': 'Uncle', 'last_name': 'Leo', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pen'},
    {'quote': "What is going on in this community? Are you people aware of what's happening? What is driving you to this behavior? Is it the humidity? Is it the Muzak? Is it the white shoes?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pen'},
    {'quote': 'Have you ever noticed how they always give you the peanuts on the planes?', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pen'},
    {'quote': "It's only for three days. Today's over and we have tomorrow. We leave on Sunday. It's one day, really.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pen'},
    {'quote': "I have never seen an old person in a new bathing suit in my life. I don't know where they get their bathing suits, but my father has bathing suits from other centuries. My parents live in Florida, and if you go down there and you forget your bathing suits then they want you to wear one of theirs. You know how that gets? ‘You need trunks son? I've got trunks for you. You can wear my trunks.’ Fathers don't wear bathing suits, they wear trunks. It's kind of the same thing a tree would wear if it went swimming. So I get in the water with in thing and it's like floating around me somewhere. Did you ever put on a bathing suit that you don't even know exactly where you are inside the bathing suit?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pen'},
    {'quote': "We've tried all kind of arrangements, but we can't seem to be friends when we sleep together.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Pen'},
    {'quote': "Why is it so difficult, uncomfortable, to be naked? It's because when you have clothes on you can always kinda make those little adjustments that people like to do ... you feel like you're getting it together, yeah, yeah pretty good, feeling good looking good. But when you're naked it's like it's so final you're, Well that's it. There's nothing else I can do. That's why I like to wear a belt when I'm naked. Cause I feel it gives me something, I know I'm naked, but you know, I like to get pockets to hang off of the belt that would be, wouldn't that be the ultimate?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Note'},
    {'quote': "Kramer, you know you are always welcome in my home but as far as Mr. Johnson is concerned, that's another story.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Note'},
    {'quote': 'It moved! It was imperceptible but I felt it.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Note'},
    {'quote': "The truth. you want the truth? It is your earrings It is the chopsticks but it's so much more. You're pretentious. You call everyone by their full name You call my doorman, Sammy, ‘Samuel,’ but you didn't even say ‘Samuel’ You went ‘Sam-U-EL.’ ‘Pappy-ay muh-shay?’ What is Pappy-ay muh-shay?", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 3, 'episode': 'The Note'},
    {'quote': "I'm not a foodie. I don't, ‘Oh, this is too rare. Oh, it's too salty.’ Just eat it and shut up. I'll eat anywhere, whatever they're having. I have eaten rotten rolls off of room service trays in hotel hallways. I have. It's not a joke. This is my life. I don't know, somebody left it. Why would someone poison a roll, and leave it in a hallway for some comic coming down at two o' clock in the morning? Why would they do that?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Busboy'},
    {'quote': 'Hunger will make people do amazing things. I mean, the proof of that is cannibalism.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Chinese Restaurant'},
    {'quote': 'Does anyone ever display the slightest sensitivity over the problems of a fellow individual? No. No. A resounding no!', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Chinese Restaurant'},
    {'quote': "You know, we're living in a society! We're supposed to act in a civilized way.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Chinese Restaurant'},
    {'quote': 'Every woman on the face of the earth has complete control of my life. And yet, I want them all…is that irony?', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Baby Shower'},
    {'quote': "I don't even care about cops. I wanna see more garbage men. It's much more important. All I wanna see are garbage trucks, garbage cans and garbage men. You're never gonna stop crime, we should at least be clean.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Chinese Restaurant'},
    {'quote': "What did you go out with me for?! Just to dump chocolate on my shirt and then just dump me altogether?! I don't deserve that kind of treatment! What, you don't have the common courtesy to return my calls?! To apologize! You think I'm some sort of a loser, that likes to be abused and ignored?! Who's shirt can be ruined without financial restitution?! Some sort of a masochist who enjoys being humiliated? You think you can avoid me like I have some sort of disease?! You have the disease! You have the disease! You may be beautiful and rich and physically…just…unbelievable, but you sicken me! You disgust me! You and everyone like you!", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Baby Shower'},
    {'quote': "What do you do at the end of a date when you know you don't want to see this person ever again, for the rest of your life? What do you say? What do you say? No matter what you say, it's a lie. ‘I’ll see you around. See you around. If you're around, and I'm around, I'll see you around that area. You'll be around other people. You won't be around me. But you will be around.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Baby Shower'},
    {'quote': "I'm having a planned C-section. My therapist told me if I go through labor, I might get psychotic.", 'first_name': 'Leslie', 'last_name': '', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Baby Shower'},
    {'quote': "Someday, before I die, mark my words—I'm gonna tell that woman exactly what I think of her. I'll never be able to forgive myself until I do.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Baby Shower'},
    {'quote': 'What is it about sex that just disrupts everything? Is it the touching? Is it the nudity?', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Deal'},
    {'quote': "I know less about women than anyone in the world. But one thing I do know is they're not happy if you don't spend the night. I could be a hot, sweaty room with no air conditioning and all they have is a little army cot this wide. You're not going anywhere.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Deal'},
    {'quote': 'Ask not what I can do for you—ask what you can do for me.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Baby Shower'},
    {'quote': "You're like a pathetic gambler. You're one of those losers in Las Vegas who keeps thinking he's gonna come up with a way to win at blackjack.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Deal'},
    {'quote': "That's why I don't have cable in my house. Because of that naked station. If I had that in my house, I would never turn it off. I wouldn't sleep, I wouldn't eat. Eventually, firemen would have to break through the door, they'd find me sitting there in my pajamas with drool coming down my face.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Deal'},
    {'quote': "You ask me to have lunch, tell me you slept with Elaine, and then say you're not in the mood for details. Now you listen to me. I want details and I want them right now. I don't have a job, I have no place to go. You're not in the mood? Well, you get in the mood!", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Deal'},
    {'quote': "Now here's another little rule. When we see each other now, we retire to our separate quarters. But sometimes, when people get involved with that, they feel pressure to sleep over. When that is not really sleep. Sleep is separate from that. And I don't see why sleep got all tied up and connected with that.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Deal'},
    {'quote': 'I have a vague recollection of doing something with someone, but it was a long, long time ago.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Deal'},
    {'quote': "I completely skipped healthy adulthood. I went from having orgasms immediately to taking forever. You could do your taxes in the time it takes me to have an orgasm. I've never had a normal, medium orgasm.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Heart Attack'},
    {'quote': 'Women go after doctors like men go after models. They want someone with knowledge of the body; we just want the body.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Heart Attack'},
    {'quote': 'You know, I lived with the Eskimos many years ago, and they used to plunge their faces into the snow.', 'first_name': 'Tor', 'last_name': 'Eckman', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Heart Attack'},
    {'quote': "Jerry, kill me, kill me now. I'm begging you. Let's just get it over with. Be a pal. Just take the pillow and put it over my face.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Heart Attack'},
    {'quote': "You know, I tell ya, I gotta say that I'm enjoying adulthood. For a lot of reasons. And, I'll tell you reason number one: as an adult, if I want a cookie, I have a cookie, okay? I have three cookies or four cookies, or eleven cookies if I want. Many times I will intentionally ruin my entire appetite.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Heart Attack'},
    {'quote': "Do you think it's effeminate for a man to put clothes in a gentle cycle?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Revenge'},
    {'quote': "That's it. This is it. I'm done. Through. It's over. I'm gone. Finished. Over. I will never work for you again. Look at you. You think you're an important man? Is that what you think? You are a laughingstock. You are a joke. These people are laughing at you. You're nothing! You have no brains, no ability, nothing! I quit!", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Revenge'},
    {'quote': "You can't win. You can't beat me. That's why I'm here and you're there. Because I'm a winner. I'll always be a winner and you'll always be a loser.", 'first_name': 'Rick', 'last_name': 'Levitan', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Revenge'},
    {'quote': "There's always that certain group of people, isn't it? They're talking and talking, and everyone around them is shushing them and shushing them. They won't shush. They're the unshushables.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Apartment'},
    {'quote': 'I just threw away a lifetime of guilt-free sex and floor seats for every sporting event in Madison Square Garden. So please, a little respect. For I am Costanza, Lord of the Idiots!', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Apartment'},
    {'quote': "You may think you're an idiot, but with all due respect—I’m a much bigger idiot than you are.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Apartment'},
    {'quote': 'You know the way I am—rarely ever thinking of myself. My only concern is the welfare and happiness of those close to me. Sure, it hurts sometimes—to give, and give, and give.', 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Apartment'},
    {'quote': 'I lie every second of the day. My whole life is a sham!', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Apartment'},
    {'quote': "Women don't wanna see need. They want a take-charge guy—a colonel, a kaiser, a tsar.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Phone Message'},
    {'quote': "What's brutal about the date is the scrutiny that you put each other through. Because whenever you think about this person in terms of the future, you have to magnify everything about them. You know, like the guy'll be like 'I don't think her eyebrows are even. Could I look at uneven eyebrows for the rest of my life?' And of course the woman's looking at the guy, thinking 'What is he looking at? Do I want somebody looking at me like this for the rest of my life?'", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Phone Message'},
    {'quote': "I think if one's going to kill oneself, the least you could do is leave a note—it's common courtesy. I don't know, that's just the way I was brought up.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Phone Message'},
    {'quote': "She invited me up. Coffee's not coffee, coffee is sex.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Phone Message'},
    {'quote': 'For me to ask a woman out I gotta get into a mental state like the karate guys before they break the bricks.', 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Phone Message'},
    {'quote': "The bad thing about television is that everybody you see on television is doing something better than what you're doing. Did you ever see anybody on TV like just sliding off the front of the sofa with potato chip crumbs on their face?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Phone Message'},
    {'quote': "I don't think there's ever been an appointment in my life where I wanted the other guy to show up.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Jacket'},
    {'quote': "I hate clothes, okay? I hate buying them. I hate picking them out of my closet. I can't stand every day trying to come up with little outfits for myself. I think eventually fashion won't even exist. It won't. I think eventually we'll all be wearing the same thing. 'Cause anytime I see a movie or a TV show where there's people from the future of another planet, they're all wearing the same thing. Somehow they decided ‘This is going to be our outfit. One-piece silver jumpsuit, V-stripe, and boots. That's it.’ We should come up for an outfit for earth. An Earth outfit. We should vote on it. Candidates propose different outfits, no speeches. They walk out, twirl, walk off. We just sit in the audience and go, ‘That was nice. I could wear that.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Jacket'},
    {'quote': "All fathers are intimidating. They're intimidating because they are fathers. Once a man has children, for the rest of his life, his attitude is, ‘To hell with the world, I can make my own people. I'll eat whatever I want. I'll wear whatever I want, and I'll create whoever I want.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Jacket'},
    {'quote': "We had a funny guy with us in Korea. A tailgunner. They blew his brains out all over the Pacific. There's nothing funny about that.", 'first_name': 'Alton', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Jacket'},
    {'quote': "You know how easy it is for dead people to travel? It's not like getting on a bus. One second. It's all mental.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Pony Remark'},
    {'quote': "You know, I've been thinking. I cannot envision any circumstances in which I'll ever have the opportunity to have sex again. How's it gonna happen? I just don't see how it could occur.", 'first_name': 'George', 'last_name': 'Costanza', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Pony Remark'},
    {'quote': "It's not that I don't think you can. I know that you can't, and I'm positive that you won't.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Pony Remark'},
    {'quote': "We don't understand death. And the proof of this is that we give dead people a pillow. And, uh, I mean, hey, you know. I think if you can't stretch out and get some solid rest at that point, I don't see how bedding accessories really make the difference. I mean, they got the guy in a suit with a pillow. No is he going to a meeting, or is he catching forty winks? I mean, let's make up our mind where we think they're going.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Pony Remark'},
    {'quote': "I didn't know she had a pony. How was I to know she had a pony? Who figures an immigrant's going to have a pony? Do you know what the odds are on that? I mean, in all the pictures I saw of immigrants on boats coming into New York harbor, I never saw one of them sitting on a pony. Why would anybody come here if they had a pony? Who leaves a country packed with ponies to come to a non-pony country? It doesn't make sense. Am I wrong?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Pony Remark'},
    {'quote': "Women need to like the job of the guy they're with. If they don't like the job, they don't like the guy. Men know this. Which is why we make up the phony bogus names for the jobs that we have. ‘Well, right now, I'm the regional management supervisor.’ ‘I’m in development, research, consulting.’ Men, on the other hand, if they are physically attracted to a woman are not that concerned with her job. Are we? Men don't really care. Men'll just go, ‘Really? Slaughterhouse? Is that were you work? That sounds interesting. So whaddaya got, a big cleaver there? You're just lopping their heads off? That sounds great! Listen, why don't you shower up, and we'll get some burgers and catch a movie?’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Ex-Girlfriend'},
    {'quote': "I can't be with someone if I don't respect what they do.", 'first_name': 'Marlene', 'last_name': '', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Ex-Girlfriend'},
    {'quote': "I am not much for the family gathering. You know, you sit there, and the conversation's so boring. It's so dull. And you start to fantasize. You know, you think, what if I just got up and jumped out that window? What would it be like? Just crashed right through the glass. You know. Come back in, there's broken glass, everybody's all upset. ‘No, I'm all right. I was just a little bored, there. No, I'm fine. I came back. I wanted to hear a little about that Hummel collection, Aunt Rose. Let's pick it up right there.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Pony Remark'},
    {'quote': "What is this obsession people have with books? They put them in their houses—like they're trophies. What do you need it for after you read it?", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 2, 'episode': 'The Ex-Girlfriend'},
