    {'quote': "The dating world is a world of pressure. Let's face it: a date is a job interview, that lasts all night. The only difference between a date and a job interview is: not many job interviews is there a chance you'll end up naked at the end of it.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 1, 'episode': 'The Seinfeld Chronicles'},
    {'quote': "What evidence is there that cats are so smart, anyway? Huh? What do they do? Because they're clean? I am sorry. My Uncle Pete showers four times a day and he can't count to ten. So don't give me hygiene.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 1, 'episode': 'The Stock Tip'},
    {'quote': "You made a man cry? I've never made a man cry. I even kicked a guy in the groin once and he didn't cry.", 'first_name': 'Elaine', 'last_name': 'Benes', 'show': 'Seinfeld', 'season': 1, 'episode': 'Male Unbonding'},
    {'quote': "I'm not an investor. People always tell me, you should have your money working for you. I've decided I'll do the work. I'm gonna let the money relax.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 1, 'episode': 'The Stock Tip'},
    {'quote': "I do not like the bank. I've heard the expression ‘Laughing all the way to the bank.’ I have never seen anyone actually doing it. And those bank lines. I hate it when there's nobody on the line at all, you know that part, you go to the bank, it's empty and you still have to go through the little maze. ‘Can you get a little piece of cheese for me? I'm almost at the front. I'd like a reward for this please.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 1, 'episode': 'Male Unbonding'},
    {'quote': "See, the great thing about guys is that we can become friends based on almost nothing. Just two guys will just become friends just because they're two guys. That's almost all we need to have in common. 'Cause sports—sports and women—is really all we talk about. If there was no sports and no women the only thing guys would ever say is ‘So, what's in the refrigerator?’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 1, 'episode': 'Male Unbonding'},
    {'quote': "Most men like working on things, tools, objects, fixing things. This is what men enjoy doing. Have you ever noticed a guy's out in his driveway working on something with tools, how all the other men in the neighborhood are magnetically drawn to this activity. They just come wandering out of the house like zombies.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 1, 'episode': 'Male Unbonding'},
    {'quote': "One of the problems in life is that when you're a kid, you have a certain way of working out disagreements...and those laws do not work in the adult world.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 1, 'episode': 'The Robbery'},
    {'quote': "Y'know I think that even if you've had a relationship with someone, or let's say, especially if you've had a relationship with someone and you try to become friends afterwards, it's very difficult. Isn't this? It's hard. Because, you know each other so well, you know all of each other's tricks. It's like two magicians, trying to entertain each other. The one goes, ‘Look, a rabbit.’ The other goes, ‘So? ... I believe this is your card.’", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 1, 'episode': 'The Stakeout'},
    {'quote': "I swear, I have absolutely no idea what women are thinking. I don't get it, OK? I, I, I admit, I, I'm not getting the signals. I am not getting it! Women, they're so subtle, their little...everything they do is subtle...men are not subtle, we are obvious. Women know what men want, men know what men want, what do we want? We want women, that's it!...It's the only thing we know for sure, it really is: we want women. How do we get them? Oh, we don't know 'bout that, we don't know.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 1, 'episode': 'The Seinfeld Chronicles'},
    {'quote': "What you must understand, Elaine, packing is no different than leading men into battle: you've gotta know the strengths and weaknesses of every soldier in that platoon. From a collapsible toothbrush to a pair of ordinary black socks.", 'first_name': 'Jerry', 'last_name': 'Seinfeld', 'show': 'Seinfeld', 'season': 1, 'episode': 'The Robbery'},
