    {'quote': 'Normally, if given the choice between doing something and nothing, I’d choose to do nothing. But I will do something if it helps someone else do nothing. I’d work all night, if it meant nothing got done.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 5, 'episode': 'Article Two'},
