    {'quote': "When people get too chummy with me I like to call them by the wrong name to let them know I don't really care about them.", 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 4, 'episode': 'Born and Raised'},
