    {'quote': 'Oh, I love any book about vampires, werewolves, monsters, zombies, sorcerers, beasties, or time-traveling romances. And if I had an hour alone with Robert Pattinson, he would forget all about Skinny Legs Magee, I’ll tell you that much.', 'first_name': 'Donna', 'last_name': 'Meagle', 'show': 'Parks and Recreation', 'season': 3, 'episode': 'Time Capsule'},
