    {'quote': "Pawnee's Library Department is the most diabolical, ruthless bunch of bureaucrats I've ever seen. They're like a biker gang but instead of shotguns and crystal meth they use political savvy and shhhing.", 'first_name': 'Leslie', 'last_name': 'Knope', 'show': 'Parks and Recreation', 'season': 2, 'episode': 'Ron and Tammy'},
    {'quote': "Halloween is my favorite holiday. It's just the best. And I don't have to work! Hey slutty teenage girls dressed as sexy kittens, pump your own stomachs this year!!", 'first_name': 'Ann', 'last_name': 'Perkins', 'show': 'Parks and Recreation', 'season': 2, 'episode': 'Greg Pikitis'},
    {'quote': "You know, in the 1880's, there were a few years that were pretty rough and tumble in Pawnee. This depicts kind of a famous fight between Reverend Bradley and Annabeth Stevenson, a widowed mother of seven. The original title of this was 'A Lively Fisting.' But y'know, they had to change it for...obvious reasons.", 'first_name': 'Leslie', 'last_name': 'Knope', 'show': 'Parks and Recreation', 'season': 2, 'episode': 'Beauty Pageant'},
    {'quote': " I was born ready. I'm Ron Fucking Swanson.", 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 2, 'episode': 'The Stakeout'},
    {'quote': 'When Andy and I used to go the movies, he would always try to guess the ending of the movie. And he would always guess that the main character had been dead the whole time. Even when we saw Ratatouille.', 'first_name': 'Ann', 'last_name': 'Perkins', 'show': 'Parks and Recreation', 'season': 2, 'episode': 'The Stakeout'},
    {'quote': "My idea of a perfect government is one guy who sits in a small room at a desk, and the only thing he's allowed to decide is who to nuke. The man is chosen based on some kind of IQ test, and maybe also a physical tournament, like a decathlon. And women are brought to him, maybe...when he desires them.", 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 1, 'episode': 'Boys Club'},
    {'quote': 'My dream is to have the park system privatized and run entirely for profit by corporations, like Chuck E. Cheese. They have an impeccable business model. I would rather work for Chuck E. Cheese.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 1, 'episode': 'Pilot'},
    {'quote': 'Time is money; Money is power; Power is pizza; Pizza is knowledge. Let’s go!', 'first_name': 'April', 'last_name': 'Ludgate', 'show': 'Parks and Recreation', 'season': 6, 'episode': 'Second Chunce'},
    {'quote': 'Strippers do nothing for me…but I will take a free breakfast buffet anytime, anyplace.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 2, 'episode': "Tom's Divorce"},
    {'quote': 'Breakfast food can serve many purposes.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 5, 'episode': 'Leslie vs. April'},
    {'quote': 'There are only three ways to motivate people: money, fear, and hunger.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 5, 'episode': 'Article Two'},
    {'quote': 'Great job, everyone. The reception will be held in each of our individual houses, alone.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 6, 'episode': 'London, Part 1'},
    {'quote': 'There are three acceptable haircuts: high and tight, crew cut, buzz cut.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 4, 'episode': 'Bowling for Votes'},
    {'quote': 'Are you going to tell a man that he can’t fart in his own car?', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 2, 'episode': 'The Possum'},
    {'quote': 'My only official recommendations are US Army-issued mustache trimmers, Morton’s Salt, and the C.R. Lawrence Fein two-inch axe-style scraper oscillating knife blade.', 'first_name': 'Leslie', 'last_name': 'Knope', 'show': 'Parks and Recreation', 'season': 3, 'episode': 'The Fight'},
    {'quote': 'The less I know about other people’s affairs, the happier I am. I’m not interested in caring about people. I once worked with a guy for three years and never learned his name. Best friend I ever had. We still never talk sometimes.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 3, 'episode': 'Flu Season'},
    {'quote': 'No home is complete without a proper toolbox. Here’s April and Andy’s: A hammer, a half-eaten pretzel, a baseball card, some cartridge that says Sonic and Hedgehog, a scissor half, a flashlight filled with jellybeans.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 4, 'episode': "Meet 'N' Greet"},
    {'quote': 'I don’t want to paint with a broad brush here, but every single contractor in the world is a miserable, incompetent thief.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 4, 'episode': 'The Comeback Kid'},
    {'quote': 'I’m a simple man. I like pretty, dark-haired women, and breakfast food.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 2, 'episode': 'Ron and Tammy'},
    {'quote': 'I call this turf ‘n’ turf. It’s a 16-ounce T-bone and a 24-ounce porterhouse. Also, whiskey and a cigar. I am going to consume all of this at the same time because I am a free American.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 2, 'episode': 'Sweetums'},
    {'quote': 'The government is a greedy piglet that suckles on a taxpayer’s teat until they have sore, chapped nipples.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 3, 'episode': 'Road Trip'},
    {'quote': 'The key to burning an ex-wife effigy is to dip it in paraffin wax and then toss the flaming bottle of isopropyl alcohol from a safe distance. Do not stand too close when you light an ex-wife effigy.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 3, 'episode': "Andy and April's Fancy Party"},
    {'quote': 'You had me at ‘Meat Tornado.’', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 3, 'episode': 'Flu Season'},
    {'quote': 'Turkey can never beat cow.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 3, 'episode': 'Soulmates'},
    {'quote': 'Clear alcohols are for rich women on diets.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 4, 'episode': 'Win, Lose, or Draw'},
    {'quote': "I'm not interested in caring about people.", 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 3, 'episode': 'Flu Season'},
    {'quote': 'Keep your tears in your eyes where they belong.', 'first_name': 'Ron', 'last_name': 'Swanson', 'show': 'Parks and Recreation', 'season': 6, 'episode': 'Ann and Chris'},
    {'quote': 'Get a friend, loser.', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 5, 'episode': 'Customer Survey'},
    {'quote': "I've never been a kiss up. It's just not how I operate. I mean I've always subscribed to the idea that if you really want to impress your boss, you go in there and you do mediocre work, half-heartedly.", 'first_name': 'Jim', 'last_name': 'Halpert', 'show': 'The Office', 'season': 5, 'episode': 'Dream Team'},
    {'quote': "I am about to do something very bold in this job that I've never done before... try.", 'first_name': 'Jim', 'last_name': 'Halpert', 'show': 'The Office', 'season': 4, 'episode': 'Job Fair'},
    {'quote': 'I miss Dwight. Congratulations, universe. You win.', 'first_name': 'Jim', 'last_name': 'Halpert', 'show': 'The Office', 'season': 3, 'episode': 'The Return'},
    {'quote': "I think it's great that the company's making a commercial, because not very many people have heard of us. I mean, when I tell people I work at Dunder Mifflin, they think that we sell mufflers or muffins or mittens or...and frankly, all of those sound better than paper, so I let it slide.", 'first_name': 'Jim', 'last_name': 'Halpert', 'show': 'The Office', 'season': 4, 'episode': 'Local Ad'},
    {'quote': "Reverse psychology is an awesome tool. I don't know if you guys know about it, but, basically, you make someone think the opposite of what you believe. And that tricks them into doing something stupid. Works like a charm.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 2, 'episode': 'Christmas Party'},
    {'quote': "In the end, the greatest snowball isn't a snowball at all. It's fear. Merry Christmas.", 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 7, 'episode': 'Classy Christmas'},
    {'quote': "Michael always says, 'K-I-S-S, keep it simple, stupid.' Great advice, hurts my feelings every time.", 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 3, 'episode': 'Initiation'},
    {'quote': "You're a perfectly fine toilet... I'm just an extraordinary piece of crap.", 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 8, 'episode': 'Trivia'},
    {'quote': "I'm gonna intimidate him, ok? Watch this....So anyways, she said that is the biggest penis I have ever scene and I said I know! That's why I brought you to the penis museum, where tickets are a thousand dollars.", 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 7, 'episode': 'The Sting'},
    {'quote': 'Michael is like Mozart, and I’m like Butch Cassidy. You mess with Mozart and you’re gonna get bullet in your head, courtesy of Butch Cassidy.', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 2, 'episode': 'Office Olympics'},
    {'quote': 'A real man swallows his vomit when a lady is present.', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 8, 'episode': 'After Hours'},
    {'quote': 'Powerpoints are the peacocks of the business world; all show, no meat.', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 8, 'episode': 'Special Project'},
    {'quote': "I overslept. Damn rooster didn't crow.", 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 3, 'episode': 'Traveling Salesmen'},
    {'quote': 'The eyes are the groin of the face.', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 4, 'episode': 'Branch Wars'},
    {'quote': 'Nothing stresses me out. Except having to seek the approval of my inferiors.', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 5, 'episode': 'Stress Relief'},
    {'quote': "You better learn your rules. If you don't, you'll be eaten in your sleep.", 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 5, 'episode': 'The Duel'},
    {'quote': 'Smoking is gonna save lives.', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 5, 'episode': 'Stress Relief'},
    {'quote': "Two weeks ago, I was in the worst relationship of my life. She treated me poorly, we didn't connect, I was miserable. Now, I am in the best relationship of my life, with the same woman. Love is a mystery.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 3, 'episode': 'The Job'},
    {'quote': 'I guess I’ve been working so hard, I forgot what it’s like to be hardly working.', 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 7, 'episode': 'Training Day'},
    {'quote': 'You cheated on me? When I specifically asked you not to?', 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 4, 'episode': 'Goodbye, Toby'},
    {'quote': "When I was five, I imagined that there was such a thing as a unicorn. And this was before I had even heard of one, or seen one. I just drew a picture, of a horse, that could fly over rainbows, and a had a huge spike in its head. I was five! Five-years-old. Couldn't even talk yet.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 4, 'episode': 'Local Ad'},
    {'quote': 'I had a great summer. I got west nile virus, lost a ton of weight. Then I went back to the lake. And I stepped on a piece of glass in the parking lot, which hurt. That got infected. Even though I peed on it...', 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 7, 'episode': 'Nepotism'},
    {'quote': 'Ok, too many different words from coming at me from too many different sentences.', 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 6, 'episode': 'Mafia'},
    {'quote': 'I am a theatrical person. Growing up I always thought I would become an actor, because, I have these memorization tricks that I use. For instance, I learned the Pledge of Allegiance by singing it to the tune of Old Macdonald: I pledge allegiance to the flag of the United States of America. And to the republic for which it stands, one nation under God. With a woof woof here and a woof woof there, here a woof, there a woof, everywhere a woof woof.', 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 5, 'episode': 'Lecture Circuit'},
    {'quote': "Oh, look! A Sbarro. My favorite New York pizza joint. And I'm going to go get me a New York slice!", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 2, 'episode': "Valentine's Day"},
    {'quote': "Hi, I'm Date Mike. Nice to meet me. How do you like your eggs in the morning?", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 6, 'episode': 'Happy Hour'},
    {'quote': 'The worst thing about prison was the dementors.', 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 3, 'episode': 'The Convict'},
    {'quote': "Here it is, heart of New York City, Times Square... named for the good times you have when you're in it.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 2, 'episode': "Valentine's Day"},
    {'quote': 'I am running away from my responsibilities. And it feels good.', 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 4, 'episode': 'Money'},
    {'quote': "I feel like all my kids grew up and then they married each other. It's every parents' dream.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 9, 'episode': 'Finale'},
    {'quote': 'I’m an early bird and I’m a night owl. So I’m wise and I have worms.', 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 2, 'episode': 'Office Olympics'},
    {'quote': 'I knew exactly what to do. But in a much more real sense, I had no idea what to do.', 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 5, 'episode': 'Stress Relief'},
    {'quote': 'Growing up I performed my own circumcision.', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 5, 'episode': 'Baby Shower'},
    {'quote': 'Identity theft is not a joke, Jim! Millions of families suffer every year.', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 3, 'episode': 'Product Recall'},
    {'quote': 'I don’t have a lot of experience with vampires, but I have hunted werewolves. I shot one once, but by the time I got to it, it had turned back into my neighbor’s dog.', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 3, 'episode': 'Business School'},
    {'quote': 'Who says exactly what they’re thinking? What kind of a game is that?', 'first_name': 'Kelly', 'last_name': 'Kapoor', 'show': 'The Office', 'season': 4, 'episode': 'Money'},
    {'quote': "I mean, I'm not a slut but who knows.", 'first_name': 'Kelly', 'last_name': 'Kapoor', 'show': 'The Office', 'season': 2, 'episode': 'The Carpet'},
    {'quote': 'I think sometimes people are really mean to the hot, popular girl.', 'first_name': 'Kelly', 'last_name': 'Kapoor', 'show': 'The Office', 'season': 5, 'episode': 'Lecture Circuit'},
    {'quote': "You guys I'm like really smart now. You don't even know. You could ask me, Kelly what's the biggest company in the world? And I'd be like, 'blah blah blah, blah blah blah blah blah blah.' Giving you the exact right answer.", 'first_name': 'Kelly', 'last_name': 'Kapoor', 'show': 'The Office', 'season': 7, 'episode': 'Nepotism'},
    {'quote': 'Mistletoe is not an excuse for sexual assault.', 'first_name': 'Andy', 'last_name': 'Bernard', 'show': 'The Office', 'season': 8, 'episode': 'Christmas Wishes'},
    {'quote': "There's a lot of beauty in ordinary things. Isn't that kind of the point?", 'first_name': 'Pam', 'last_name': 'Halpert', 'show': 'The Office', 'season': 9, 'episode': 'Finale'},
    {'quote': "Dwight, listen: no matter what happens, you gotta forget about all the other stuff. You gotta forget about logic and fear and doubt. You just gotta do everything you can to get to the one woman who's gonna make all this worth it. At the end of the day, you gotta jump. You love Angela, Dwight. I think you always have.", 'first_name': 'Jim', 'last_name': 'Halpert', 'show': 'The Office', 'season': 9, 'episode': 'A.A.R.M.'},
    {'quote': 'This is a documentary? Oh. I always thought we were like specimens in a human zoo.', 'first_name': 'Kevin', 'last_name': 'Malone', 'show': 'The Office', 'season': 9, 'episode': 'Promos'},
    {'quote': "I really like Andy these days. He's pretend, and he does exactly as I tell him to. All that will change when real Andy comes back tomorrow. Unless he comes back as pretend Dwight. In which case, we're in for an epic, confusing showdown.", 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 9, 'episode': 'Couples Discount'},
    {'quote': "I know you saw me with the Senator. I think I'm in love, possibly for the first time. So yes, Senator Lipton and I are having an affair. I hope that I can count on your sensitivity, maturity, and discretion.", 'first_name': 'Oscar', 'last_name': 'Martinez', 'show': 'The Office', 'season': 9, 'episode': 'The Boat'},
    {'quote': 'At first I drove myself crazy thinking about the things I should have done differently. I never should have played that joke on Erin. I never should have hollowed out this damn pumpkin in the first place. Then I realized that I was being silly. I mean the pumpkin should rot off of my head in a month or two. Right?', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 9, 'episode': 'Here Comes Treble'},
    {'quote': 'There are two things I am passionate about: recycling and revenge.', 'first_name': 'Andy', 'last_name': 'Bernard', 'show': 'The Office', 'season': 9, 'episode': 'New Guys'},
    {'quote': 'Sometimes I feel like everyone I work with is an idiot. And by sometimes I mean all times. All the times. Every of the times!', 'first_name': 'Kevin', 'last_name': 'Malone', 'show': 'The Office', 'season': 8, 'episode': 'Fundraiser'},
    {'quote': "I'm in love with Kelly Kapoor. And I don't know how I'm gonna feel tomorrow or the next day or the day after that, but I do know that right here, right now, all I can think about is spending the rest of my life with her. Again, that could change.", 'first_name': 'Ryan', 'last_name': 'Howard', 'show': 'The Office', 'season': 8, 'episode': 'Angry Andy'},
    {'quote': "Maybe we weren't right together, but, it's weird. I'd rather she be alone than with somebody. Is that love?", 'first_name': 'Ryan', 'last_name': 'Howard', 'show': 'The Office', 'season': 8, 'episode': 'Angry Andy'},
    {'quote': 'Tough day. Yes. But I feel good. I put the office in their place, took a bunch of painkillers, drank a bottle of wine, took my pants off. I just feel good.', 'first_name': 'Andy', 'last_name': 'Bernard', 'show': 'The Office', 'season': 8, 'episode': 'Test the Store'},
    {'quote': 'Sometimes I get so bored I just want to scream, and then sometimes I actually do scream. I just sort of feel out what the situation calls for.', 'first_name': 'Kelly', 'last_name': 'Kapoor', 'show': 'The Office', 'season': 8, 'episode': 'After Hours'},
    {'quote': "Life is short. Drive fast and leave a sexy corpse. That's one of my mottos.", 'first_name': 'Stanley', 'last_name': 'Hudson', 'show': 'The Office', 'season': 8, 'episode': 'Tallahassee'},
    {'quote': "The Schrutes have a word for when everything in a man's life comes together perfectly. Perfectenschlag. Right now, I am in it. I finally get a chance to prove myself to corporate. I am assembling a competent team. I am likely a father. I am so deep inside of perfectenschlag right now. And, just to be clear, there is a second definition, 'perfect pork anus', which I don't mean.", 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 8, 'episode': 'Special Project'},
    {'quote': "I haven't proposed to anyone in years.", 'first_name': 'Andy', 'last_name': 'Bernard', 'show': 'The Office', 'season': 8, 'episode': 'Pool Party'},
    {'quote': "My ex is meeting my sex. Which is always scary, you know? And not just because you think they might talk about your penis. That's just part of it.", 'first_name': 'Andy', 'last_name': 'Bernard', 'show': 'The Office', 'season': 8, 'episode': 'Christmas Wishes'},
    {'quote': "The Civil War history industry has conveniently forgotten about the battle of Schrute Farms. Whatever. I'm over it. It's just grossly irresponsible.", 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 8, 'episode': 'Gettysburg'},
    {'quote': "There's this thing that people tend to do with billboards. How do I put this? If there's an opportunity for a graffiti artist to work in a... phallic shape, interacting with the artwork, it'll happen, and Andy gave them that opportunity.", 'first_name': 'Jim', 'last_name': 'Halpert', 'show': 'The Office', 'season': 8, 'episode': 'Garden Party'},
    {'quote': "My future isn't going to be determined by seven little white lotto balls. It's going to be determined by two big black balls.", 'first_name': 'Darryl', 'last_name': 'Philbin', 'show': 'The Office', 'season': 8, 'episode': 'Lotto'},
    {'quote': "I got away with everything under the last boss and it wasn't good for me. So I want guidance. I want leadership. Lead me... when I'm in the mood to be led.", 'first_name': 'Ryan', 'last_name': 'Howard', 'show': 'The Office', 'season': 7, 'episode': 'Search Committee'},
    {'quote': "Oh, this is gonna feel so good getting this thing off my chest... that's what she said.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 7, 'episode': 'Goodbye, Michael'},
    {'quote': "Michael is leaving. And apparently they've already hired a new manager. And we're meeting him today. It's a lot to process. Paperwork-wise.", 'first_name': 'Oscar', 'last_name': 'Martinez', 'show': 'The Office', 'season': 7, 'episode': 'Training Day'},
    {'quote': "I am a huge Woody Allen fan. Although I've only seen 'Antz.' But I'll tell you something, what I respect about that man is that when he was going through all of that stuff that came out in the press, about how 'Antz' was just a ripoff of 'A Bug's Life,' he stayed true to his films. Or at least the film that I saw, which, again, was 'Antz.' Thing is, I thought 'A Bug's Life' was better, much better than 'Antz.' Point is, don't listen to your critics. Listen to your fans.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 7, 'episode': 'Threat Level Midnight'},
    {'quote': "My perfect Valentine's day? I'm at home, three cell phones in front of me, fielding desperate calls from people who want to buy one of the fifty restaurant reservations I made over six months ago.", 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 7, 'episode': 'PDA'},
    {'quote': "Holly is ruining Michael's life. He thinks she is so special, and she's so not. Her personality is like a 3. Her sense of humor is a 2. Her ears are like a 7 and a 4. Add it all up and what do you get? 16. And he treats her like she's a perfect 40. It's nuts.", 'first_name': 'Erin', 'last_name': 'Hannon', 'show': 'The Office', 'season': 7, 'episode': 'The Search'},
    {'quote': 'Ultimatums are key. Basically nobody does anything for me anymore unless I threaten to kill myself.', 'first_name': 'Kelly', 'last_name': 'Kapoor', 'show': 'The Office', 'season': 7, 'episode': 'Classy Christmas'},
    {'quote': 'I have been trying to get on jury duty every year since I was 18 years old. To get and go sit in an air-conditioned room, downtown, judging people, while my lunch was paid for. That is the life.', 'first_name': 'Stanley', 'last_name': 'Hudson', 'show': 'The Office', 'season': 7, 'episode': 'Classy Christmas'},
    {'quote': "The world sends people your way. Ryan came to me through a temp agency. Andy was transferred here. No idea where Creed came from. The point is, you just have to play with the cards that you're dealt. Jim, that guy is an Ace. Dwight is my King up my sleeve. Phyllis is my Old Maid. Oscar is my Queen. That's easy. Give me a hard one. That's what Oscar said. Toby is the Instruction Card you throw away, Pam is a solid 7, and you know, Ryan is probably like a 2. Sometimes 2s can be wild, so watch out. And I'm obviously the Joker.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 7, 'episode': 'WUPHF.com'},
    {'quote': "Yes, I have a dream, and it's not some MLK dream for equality. I want to own a decommissioned lighthouse. And I want to live at the top. And nobody knows I live there. And there's a button that I can press, and launch that lighthouse into space.", 'first_name': 'Stanley', 'last_name': 'Hudson', 'show': 'The Office', 'season': 7, 'episode': 'WUPHF.com'},
    {'quote': "If you break that girl's heart, I will kill you. That's just a figure of speech. But seriously, if you break that girl's heart, I will literally kill you and your entire family.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 7, 'episode': 'Viewing Party'},
    {'quote': "Stanley just drank OJ out of my mug, and didn't seem to realize that it wasn't his hot coffee. So the question has to be asked, is there no limit to what he won't notice?", 'first_name': 'Jim', 'last_name': 'Halpert', 'show': 'The Office', 'season': 7, 'episode': 'Costume Contest'},
    {'quote': "Hi Holly, it's Michael. I just wanted to call and let you know that I was thinking about what you said, it's just... you know? It's weird, today I ended up seeing a lot of the women that I used to date, and in my mind they were all great, and then when I actually saw them it was mostly a freak show. And you and me, that must've been a real train wreck. You know what? Holly, you're wrong. You are wrong. I remember every second of us, and talking to you today, I-don't-feel for them anything like what I feel for you. It's... I didn't joke with any of them, I joked with you, you were the only one who was actually happy to hear from me, and I don't know why you downgraded what we had, but I did not make us up. Ok. Oh, and you might... you should talk to a doctor because you might have herpes. Bye!", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 7, 'episode': 'Sex Ed'},
    {'quote': 'My parents used to scramble to find babysitters, so they could take my little brother to do stuff.', 'first_name': 'Andy', 'last_name': 'Bernard', 'show': 'The Office', 'season': 7, 'episode': "Andy's Play"},
    {'quote': 'I talk a lot, so I learn to tune myself out.', 'first_name': 'Kelly', 'last_name': 'Kapoor', 'show': 'The Office', 'season': 7, 'episode': 'Counseling'},
    {'quote': "Guess what, I have flaws. What are they? Oh I don't know. I sing in the shower. Sometimes I spend too much time volunteering. Occasionally I'll hit somebody with my car. So sue me.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 4, 'episode': 'Fun Run'},
    {'quote': 'Dwight you ignorant sl**.', 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 3, 'episode': 'Safety Training'},
    {'quote': "Bros before ho**. Why? Because your bros are always there for you. They've got your back after your hoe rips your heart out for no good reason. And you were nothing but great to your ho*. And you told her she was the only ho* for you. And that she was better than all the other hoes in the world. And then, suddenly she is not your ho* no mo.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 3, 'episode': 'A Benihana Christmas'},
    {'quote': "It's not like booze ever kil*** anyone.", 'first_name': 'Michael', 'last_name': 'Scott', 'show': 'The Office', 'season': 2, 'episode': 'Booze Cruise'},
    {'quote': 'Who is Justice Beaver?', 'first_name': 'Dwight', 'last_name': 'Schrute', 'show': 'The Office', 'season': 7, 'episode': 'Todd Packer'},
    {'quote': "I feel God in this Chili's tonight.", 'first_name': 'Pam', 'last_name': 'Beesly', 'show': 'The Office', 'season': 2, 'episode': 'The Dundies'},
